INSERT INTO `myapp_subvencion` VALUES (1,'2018-01-03','2018-02-02','2018-02-02 18:49:48','2018-03-26 10:55:32','UC0Vb1','Fomento de la lengua y cultura popular valenciana','https://drive.google.com/open?id=1Ikp-oJkMl4AjZqFWPVf6yi7alcUpjZgU','https://drive.google.com/open?id=14aRHxdySpvPDQQp7ZnnQrnKvO7aPpWON','','DA','1500 €','Subvenciones para realizar actividades de fomento de la lengua y cultura popular valenciana, ya realizadas o por realizar entre el 01 de octubre de 2017 y 30 de septiembre de 2018.','Se ha pedido la maquetación del inventario de fuentes','https://drive.google.com/open?id=0B-6ZND28b8BsdkE4dHUzRXVpM0E','3/2018 EXP 1',1,1,NULL,5,NULL),(2,'2018-01-03','2018-02-02','2018-02-02 19:05:51','2018-03-26 10:55:40','nyF7H5','Actividades culturales de especial relieve','-','-','','DA','-','Subvencionar actividades culturalres de especial relieve realizadas entre el 01 de octubre de 2017 a 30 de septiembre de 2018','FESTA PARLAR DEL SA _ SUBVENCION AL 40 %','--','--',1,1,NULL,5,NULL),(3,'2018-01-03','2018-02-02','2018-02-02 19:09:41','2018-03-26 10:55:48','eL3H6y','Campaña de Música als Pobles','--','--','','DA','--','Difusión cultural mediante la interpretación de conciertos en local o lugar público, en su municipio o en otro de la provincia, por las bandas de música de las Sociedades Musicales de la provincia de Alicante pertenecientes a la Federación de Sociedades Musicales de la Comunidad Valenciana','','--','--',1,8,NULL,5,NULL),(4,'2018-02-06','2018-02-05','2018-02-02 19:15:45','2018-03-26 10:56:29','EGUReK','Actividades culturales, musicales y escénicas 2018','--','--','','DA','--','Subvenciones para actividades culturales, musicales y escénicas 2018','ESPECTACULOS CULTURALES Y MUSICALES PARA LA FERIA DURANTE LOS DIAS 21 Y 22 DE JULIO.','--','3/2018 EXP 3',1,1,NULL,5,NULL),(5,'2018-01-23','2018-02-22','2018-02-02 20:24:00','2018-04-17 19:54:05','v317Fi','Equipamiento de Instalaciones Culturales de titularidad municipal','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00042.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00043.pdf','','DA','7000 €\r\n80%','Se pidió el año 2016. Así que este año se puede pedir\r\n\r\nColaborar económicamente con los Ayuntamientos al objeto de mejorar las instalaciones para la prestación a los usuarios de sus servicios culturales.\r\n\r\nA estos efectos serán subvencionables inversiones tales como adquisición de mobiliario, (mesas, sillas, armarios), equipos de audiovisuales e informáticos, fotocopiadoras y equipos multifunción, equipos audiovisuales e informáticos, fotocopiadoras y equipos multifunción, equipos de climatización (aire acondicionado). Y no serán subvencionables las adquisiciones de equipamiento no inventariable (mesa/silla pegables...).','<p>JC:17-04-2018: Finalmente se piden <strong>focos</strong> y <strong>altavoces</strong> para el sal&oacute;n de actos casa cultura. Y 2 <strong>ordenabores</strong> y 2 <strong>impresoras multifunci&oacute;n</strong></p>\r\n<p>Se podr&iacute;a usar para cambiar los aires acondicionados en el sal&oacute;n de plenos. O a&ntilde;adirlos en ses vivendes. IMPORTANTE HAY QUE ARREGLAR EL AIRE ACONDICIONADO DE LA SALA DE LA CASA DE CULTURA - YA HAY UN PRESUPUESTO Y HAY QUE PEDIR OTROS -Un ordenador para ses vivendes, servidor de la biblioteca y para usuario final (dos) Le he pedido dos ordenadores como los que pedimos para Maril&oacute; y MariaVicenta. Podr&iacute;an usarse para amics des museu y ses vivendes (jovenes) - en la casa de cultura, un escenario fijo. tengo el plano que me ha hecho josemi. Faltar&iacute;a enviar los planos a http://guil-staging.com - Una barra donde poner el proyector luces y altavoces. le he pedido un presupuesto a Mateu para una barra para focos, unos focos y unos altavoces fijos para la sala 22-02-2018 - al final se env&iacute;an dos presupuestos de material inform&aacute;tico y focos y material para el escenario casa cultura</p>','https://drive.google.com/file/d/1C-qK4hF11kg20MzbK5OyB1gqWLIXKSPv/view?usp=sharing','3/2018 EXP 7',1,4,NULL,5,NULL),(6,'2016-12-30','2017-01-30','2018-02-02 20:45:20','2018-04-13 19:59:13','g32pEc','Equipamiento instalaciones culturales municipales, 2017','--','--','','DA','--','','Este año no se podía optar a ella. Por haberla pedido el año pasado.','','-',1,10,NULL,5,NULL),(9,'2018-02-13','2018-05-16','2018-02-18 17:25:59','2018-04-25 12:27:27','W7Qouo','Ayudas para la aplicación de medidas de gestión forestal sostenible en el marco del Programa de Desarrollo Rural de la Comunitat Valenciana 2014-2020','http://www.gva.es/es/inicio/procedimientos?id_proc=18518','https://www.dogv.gva.es/datos/2017/09/05/pdf/2017_7675.pdf','','GV','4.000 - 10.000 €','Concesión de ayuda para la realización de inversiones destinadas al desarrollo de zonas forestales y a la mejora de la viabilidad de los bosques, basadas en la gestión sostenible y multifuncional de los mismos:\r\n\r\n- Operación 8.5.1. Instrumentos de gestión forestal sostenible;\r\n- Operación 8.5.2. Gestión forestal sostenible para la mejora ambiental, paisajística y fomento de los ecosistemas forestales;\r\n- Operación 8.6.1. Inversiones para la transformación y comercialización de productos forestales.','<p>JC: 25-04-2018: Pues todo ha ido bien estos d&iacute;as. Se pusieron en contacto conmigo, en concreto Juan R. Gazquez, Jefe de la Secci&oacute;n Forestal. Que pusiermos las hect&aacute;reas con el arbolado que hubiera actualmente. Hablo seguidamente con Raimon para transmitirle la informaci&oacute;n. M&aacute;s tarde me env&iacute;a la nueva propuesta (de palabra) que significa que no tendr&iacute;amos que poner dinero para la redacci&oacute;n del Plan. Le pido a @MVicenta que me vaya sacando los certificados catastrales. Los tengo encima de mi mesa en papel. Ahora env&iacute;o correo a @MVicenta para que me pase los pdf y subirlos al expediente que acabo de crear. El viernes hablar&eacute; con Raimon.</p>\r\n<p>JC: 16-04-2018: Se amplia el plazo hasta el 16 de mayo. Carmen no contesta. Hay que mirar el presupuesto.</p>\r\n<p>28-03-2018 - tras reuni&oacute;n el d&iacute;a de ayer con Raimon seguimos trabajando en el asunto. Visito registro de la propiedad y sigo pista del \"certificado catastral\" y lo consigo. Hoy hablar&eacute; con alguno de los propietarios colindantes a ver que opinan. (24-03-2018)- le voy a proponer a Raimon P&eacute;rez que nos centremos en esta ayuda y descartemos la de planes contra incendios.</p>','https://drive.google.com/open?id=1r1tyYh1YhZ3IVvq-3AKaP_-Mmpi3FvTr','3/2018 EXP. 32',NULL,4,3,5,NULL),(10,'2018-02-15','2018-03-28','2018-02-20 07:32:41','2018-03-28 06:19:11','S6NLyo','Ayudas destinadas para la redacción de nuevos Planes Locales de Prevención de Incendios Forestales (PLPIF) o para la revisión de los ya aprobados','http://www.gva.es/es/inicio/procedimientos?id_proc=18692','https://www.dogv.gva.es/datos/2017/09/29/pdf/2017_8442.pdf','','GV','3.500 €','Revisión de plan local de prevención de incendios forestales.\r\nEn todo el periodo 2014-2020 sólo se podrá percibir ayuda una sola vez para el mismo concepto.','Me pongo en contacto con Raimon, un chico de Callosa. Me comenta que podemos pedirla pero por los pelos, ya que en primera 2:\r\nc) Se considera revisión de un PLPIF a los efectos de esta subvención, cuando este cuente con una resolución aprobatoria de la conselleria competente en prevención de incendios forestales y:\r\n– Ha cumplido la vigencia aprobada.\r\n– Deba adaptarse a una planificación de rango superior vigente, a la que está subordinada. \r\n\r\na este segundo punto, el de adaptación, podríamos acogernos porque parece que el año pasado cambiaron las normas técnicas.\r\nCreo que de todas maneras, podríamos dejarlo pasar, porque el plan fue aprobado hace poco más de un año. Podemos seguir con él y quizás para el año que viene o el 2020 pedir esta revisión. Así también apretamos en otras subvenciones, como la de \"gestión forestal sostenible\".\r\n\r\n28-03-2018 - Finalmente lo dejamos pasar para el año que viene o el siguiente y nos centramos en \"gestión forestal sostenible\"','-','-',NULL,10,3,5,NULL),(11,'2018-02-14','2018-03-12','2018-02-20 08:21:01','2018-04-16 18:29:21','bgMDM0','entidades sin fin de lucro, dentro del ámbito de los servicios sociales, para la realización de actividades de carácter formativo, terapéutico y/o rehabilitador','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00052.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00048.pdf','','DA','3.000','Colaborar con asociaciones y entidades sin fin de lucro en el ámbito de los Servicios Sociales para la realización de proyectos de carácter formativo, terapéutico y/o rehabilitador dirigidos tanto a las personas afectadas como a sus familiares, personal cuidador, voluntariado y profesionales de dichas entidades con la finalidad de mejorar la calidad de vida y la reinserción social de las personas afectadas. Asimismo se incluye la realización de proyectos de sensibilización dirigidos a mejorar la percepción de la ciudadanía sobre la situación de estos colectivos sociales.','<p>Para la ONG Familias Alternativas</p>','-','-',6,10,NULL,5,NULL),(12,'2018-02-14','2018-03-12','2018-02-20 08:52:36','2018-04-16 18:31:03','cLoAB2','entidades sin ánimo de lucro en el ámbito del bienestar social para el desarrollo de actividades de promoción de la convivencia a través del ocio y el tiempo libre','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00051.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00047.pdf','','DA','3.000','Sufragar el coste de los desplazamientos que realicen las entidades solicitantes para la realización de actividades de ocio y tiempo libre, orientadas a la promoción de la convivencia de los colectivos destinatarios del servicio\r\nDestinatarios	Entidades sin ánimo de lucro con sede social o delegación estable en la provincia de Alicante y cuya actuación se desarrolle en los sectores de discapacidad, enfermedad mental, adicciones, población vulnerable y/o en riesgo de exclusión social y colectivos sociosanitarios','<p>Podr&iacute;a promoverla Familias Alternativas con la asociaci&oacute;n de j&oacute;venes.</p>','-','-',6,10,NULL,5,NULL),(13,'2017-12-27','2018-05-31','2018-02-20 09:04:54','2018-03-16 08:08:41','rmY7e8','Ayudas no dinerarias para reparaciones y conservación de caminos de titularidad no provincial a ejecutar por la Diputación','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00043.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00038.pdf','','DA','5.000','Convocatoria anticipada de ayudas no dinerarias a favor de Ayuntamientos y Entidades locales de la Provincia de Alicante con población inferior a 5.000 habitantes, para reparaciones y conservación de caminos de titularidad no provincial a ejecutar por la Diputación provincial de Alicante. Año 2018.\r\nDestinatarios	Ayuntamientos y entidades locales de la provincia de Alicante con población inferior a 5.000 habitantes.','Se pidió el camino de bijouca - garx.\r\n\r\nen la primera convocatoria no aparecemos (14/03/2018).','https://drive.google.com/open?id=1sWbDI9F7q7migPUCGqZrOQf2dveCJde0','3/2018 EXP 8',3,1,NULL,5,NULL),(14,'2018-02-17','2018-03-13','2018-02-20 17:09:00','2018-04-16 18:35:37','9NtVLL','Subvenciones destinadas a ayuntamientos y mancomunidades para la realización de actividades de promoción social dirigidas a colectivos vulnerables y para la adquisición de equipamiento destinado a centros y otros espacios municipales de uso social','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00054.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00050.pdf','','DA','>12.000','Colaborar en el desarrollo de proyectos y actividades que faciliten la inserción, la promoción social y la prevención de riesgos de colectivos vulnerables atendidos desd