.diputacionalicante.es/detalle-catalogo-servicios/?id=191','DA','','Reparación de infraestructuras hidráulicas a ejecutar por los municipios.RACH 2018','JC: 10-04-2018: Estoy gestionando la ayuda de conselleria sobre caminos (ver en subvenciones relacionadas). Estaría bien sincronizarlo para hacer primero la tubería y después asfaltar el camino.\r\n\r\nTUBERIA RAFALET FRANÇOIS','-','2/2017 EXP 38',2,4,NULL,5,NULL),(22,'2018-02-17','2018-03-13','2018-02-21 08:08:12','2018-04-16 18:51:18','UQEH5o','Subvenciones a Instituciones sin fin de lucro en el ámbito del Bienestar Social para la adquisición de equipamiento','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00053.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00049.pdf','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=58','DA','< 5.000 €','Ayudas económicas para la adquisición de equipamiento general (mobiliario, equipos informáticos, maquinaria de oficina…) y de equipamiento específico (material técnico-rehabilitador).','<p>Familias Alternativas</p>','','--',6,10,NULL,5,NULL),(23,'2018-02-17','2018-03-13','2018-02-21 08:22:53','2018-02-25 14:53:58','63YfZV','Subvenciones a Instituciones sin fin de lucro en el ámbito del Bienestar Social para la adquisición de equipamiento','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00053.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00049.pdf','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=58','DA','','Ayudas económicas para la adquisición de equipamiento general (mobiliario, equipos informáticos, maquinaria de oficina…) y de equipamiento específico (material técnico-rehabilitador).\r\n\r\nDestinatarios\r\nEntidades privadas sin fin de lucro pertenecientes al ámbito del Bienestar Social','','-','-',6,2,NULL,5,NULL),(24,'2018-02-08','2018-03-26','2018-02-22 10:45:15','2018-03-26 17:18:41','x4zvQx','Solicitud de subvenciones para sostenimiento de gastos corrientes de las mancomunidades de municipios de la Comunitat Valenciana.','http://www.dogv.gva.es/datos/2018/02/21/pdf/2018_1616.pdf','https://www.tramita.gva.es/ctt-att-atr/asistente/iniciarTramite.html?tramite=DGM_SUB&version=1&login=c&idioma=es&idCatGuc=PR&idProcGuc=16274','http://www.gva.es/es/inicio/procedimientos?id_proc=16274','GV','100.000','Coadyuvar al desarrollo integral de las mancomunidades de municipios de la Comunitat Valenciana, a través de la financiación de sus gastos corrientes en bienes y servicios.','JuanCarlos: me quedé sin tiempo para hablarlo con mancomunidad','','-',NULL,10,5,5,NULL),(25,'2018-02-22','2018-03-13','2018-02-22 19:20:06','2018-04-17 20:57:33','9zEI7K','Concesión de Premios a los Mejores Deportistas, al Mejor Técnico y Mejor Club Deportivo de la Provincia.','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00055.pdf','','','DA','','Deportistas. Deportistas discapacitados. Jóvenes valores que no superen la edad de 17 años, al 31 de diciembre del año al que se refiere la convocatoria. Técnicos Deportivos. Todos ellos deben ser naturales de la Provincia de Alicante, o acreditar su residencia continuada en la misma, al menos en los tres últimos años. Clubes Deportivos que, legalmente constituidos e inscritos en el registro correspondiente, estén radicados en la Provincia de Alicante, y desarrollen una o varias disciplinas deportivas y se hallen adscritos a la correspondiente Federación.','','','-',7,4,NULL,5,NULL),(26,'2018-02-24','2018-10-31','2018-02-24 18:00:30','2018-02-25 14:52:33','ED2Izm','Solicitud de estancias en balnearios de la Comunidad Valenciana: Programa de Termalismo Valenciano','http://www.gva.es/es/inicio/procedimientos?id_proc=1177','http://www.dogv.gva.es/datos/2018/02/23/pdf/2018_1771.pdf','','GV','200 € persona','La Generalitat contribuirá a la financiación del coste de las plazas con una aportación máxima de 126,5 euros IVA incluido para temporada alta y 200 euros IVA incluido para temporada baja, por plaza a cada uno de los/as beneficiarios/as del programa, abonando dicha cantidad al establecimiento receptor y corriendo por cuenta del la persona beneficiaria, el resto del importe conforme con los precios que se indican en el anexo I de la convocatoria.','Se convocan 10.378 plazas en dos temporadas\r\n\r\nUna vez comprobado el cumplimiento de los requisitos, la adjudicación de plazas se realizará según el orden de presentación de solicitudes que servirá como criterio único en la mencionada adjudicación, así como en el orden de reserva de las personas que no obtengan plaza directa.','','-',NULL,4,7,5,NULL),(27,'2018-02-22','2018-03-22','2018-02-24 18:11:57','2018-03-23 06:54:06','tCRzkv','EMERGE 2018. Programa de subvenciones Iniciativa Social, destinadas a la contratación, para la realización de acciones previstas en planes o procedimientos de emergencias en el ámbito forestal','http://www.gva.es/es/inicio/procedimientos?id_proc=19132','http://www.dogv.gva.es/datos/2018/02/22/pdf/2018_1711.pdf','','GV','66.000 €','El objeto de estas subvenciones es la contratación de personas desempleadas por corporaciones locales de la Comunitat Valenciana para la realización de acciones previstas en planes o procedimientos de emergencias en el ámbito forestal .','@thierry, ¿cuando se solicitó?\r\nestá bien poner aquí en el comentario, cuando se pidió y algún dato al respecto\r\n\r\n23/03/2018- hoy aparece de nuevo la convocatoria, no sé si es que hay que añadir algunos datos a la petición previa','','-',NULL,3,6,5,NULL),(28,'2018-02-26','2018-03-26','2018-02-26 18:14:23','2018-03-23 19:44:46','2txvZt','Red COMDES - Solicitud de autorización para el uso de la Red de Comunicaciones Móviles Digitales de Emergencias y Seguridad de la Comunitat Valenciana','http://www.gva.es/es/inicio/procedimientos?id_proc=18815&version=amp','','','GV','--','Procedimiento de solicitud de autorización temporal para el uso de la Red COMDES. \r\n\r\nLa autorización que se emita en respuesta a esta solicitud habilitará para el uso de la red COMDES con carácter temporal hasta que se apruebe la nueva regulación del uso de la red COMDES, momento en que se procederá a la autorización definitiva según esta regulación establezca.','Hay en rellenar el formulario este\r\nhttp://www.gva.es/downloads/publicados/IN/07246_BI.pdf\r\na través de certificado electrónico\r\n\r\n¿Qué documentación se debe presentar?\r\n- Solicitud de autorización de la entidad solicitante conforme al impreso normalizado debidamente cumplimentado.\r\n\r\n- Se debe adjuntar a la solicitud uno de los dos siguientes documentos en función del tipo de entidad solicitante:\r\n\r\na) Para administraciones titulares de servicios de intervención ante emergencias: acto administrativo que acredite que la administración aprueba solicitar la autorización para el uso de la red COMDES de la Generalitat, y persona a la que se faculta para ello.\r\n\r\nb) Para consorcios: copia del acuerdo de sus órganos de gobierno que acredite que aprueban solicitar la autorización para el uso de la red COMDES de la Generalitat y persona a la que se faculta para ello.\r\n\r\nLa Administración o el consorcio acepta con su solicitud que las prestaciones y funcionalidades de los servicios de comunicaciones que ofrece la Red COMDES, en particular la cobertura y la capacidad, son adecuadas para la operativa de los servicios de intervención que dependen de la misma. Para ello podrá requerir al operador de Red información sobre dichos servicios, y realizar pruebas de funcionamiento con carácter previo a la solicitud de autorización para el uso de la Red.','','-',NULL,4,8,5,NULL),(29,'2018-02-26','2018-03-31','2018-02-26 20:03:53','2018-04-24 08:25:58','m4RMg4','PIMA Residuos y PEMAR','https://drive.google.com/open?id=1TsrLBMyTOKSF3p-579QTmUwNvVlBzElu','','','GV','','Promover actuaciones que permitan reducir las emisiones de gases de efecto invernadero (GEI) y avanzar en la consecución de los\r\nobjetivos de la Directiva 2008/98/CE de Residuos, de la Ley 22/2011, de 28 de julio, de residuos y suelos contaminados, del Plan Estatal Marco de Gestión de Residuos (PEMAR), así como en el cumplimiento de los objetivos relativos a las energías renovables.\r\nCon estas ayudas se promueve especialmente la implantación de proyectos innovadores por parte de entidades locales que están lejos todavía de alcanzar los objetivos comunitarios.','<p>JC: 23-04-2018: La semana anterior visito al Jefe servicio residuos Emili Gombau, me confirma que se pudo enviar la subvenci&oacute;n al ministerio. Tambi&eacute;n hoy mismo Joan Piquer me lo confirma.</p>\r\n<p>JC - 13-04-2018: La envi&eacute; finalmente por correo a Piquer. No tengo noticias. La semana que viene lo volvemos a mirar. JC - 06/04/2018 - estoy a punto de lanzar la subvenci&oacute;n. La subo al gestiona. y bueno, no s&eacute; si el lunes podremos enviarla. Ya veremos. sino, pues ya tenemos avanzado el tema para otro a&ntilde;o. Compostadores dom&eacute;sticos Compostadores para viviendas unifamiliares con jard&iacute;n o huerto en los que se los depositen y se composten los biorresiduos. Deber&aacute;n incorporar, como m&iacute;nimo, la identificaci&oacute;n (con una pegatina o serigraf&iacute;a) de los materiales que se pueden depositar en su interior. 80 &euro;/compostador Actuaciones de formaci&oacute;n y seguimiento del proyecto Las actuaciones de formaci&oacute;n y seguimiento deber&aacute;n incluir un plan de trabajo. En el caso de compostaje comunitario tambi&eacute;n incluir&aacute;n una gu&iacute;a que detalle los biorresiduos objeto de compostaje para cada vivienda participante. En el caso de compostaje dom&eacute;stico tambi&eacute;n incluir&aacute;n un manual de compostaje para cada vivienda participante. 12 &euro;/habitante Contenedores para la v&iacute;a p&uacute;blica (molar&iacute;a con tarjeta) Los contenedores para la recogida separada de biorresiduos en la v&iacute;a p&uacute;blica deber&aacute;n ser, parcial o totalmente, de color marr&oacute;n o incorporar una identificaci&oacute;n de color marr&oacute;n. La resistencia de los contenedores ser&aacute; la equivalente al peso del contenedor lleno de materia org&aacute;nica y &eacute;stos deber&aacute;n permitir la incorporaci&oacute;n de sistemas de identificaci&oacute;n y pesado. El contenedor incluir&aacute; una impresi&oacute;n permanente de los materiales que pueden ser depositados en su interior. 5 &euro;/habitante atendido 29-03-2018 - He hablado con Patricia de Spora. Les env&iacute;o presupuesto con varias cosas. La semana que viene hablaremos.</p>','https://drive.google.com/open?id=1i3uHArLXE5Ph29lfLWQ2rf_eydNBcMnM','3/2018 EXP. 22',NULL,3,3,5,NULL),(30,'2018-02-22','2018-10-31','2018-02-28 17:28:41','2018-02-28 17:28:41','ziN1fK','CAMPAÑA DE MUSICA Y TEATRO 2018','http://sede.diputacionalicante.es/detalle-catalogo-servicios?id=76','','','DA','','','','','3/2018 EXP 11',1,4,NULL,5,NULL),(32,'2018-03-02','2018-03-15','2018-03-02 12:43:13','2018-03-26 17:18:59','AqytPd','Campamentos de verano para jóvenes durante el verano de 2018, modalidad A, dirigida a ayuntamientos de la Comunitat Valenciana, dentro de la campaña Viu L\'Estiu.','http://www.gva.es/es/inicio/procedimientos?id_proc=19258','http://www.dogv.gva.es/datos/2018/02/28/pdf/2018_1901.pdf','http://www.ivaj.gva.es/campamentos','GV','','Ofrecer plazas a los ayuntamientos de la Comunitat Valenciana en el programa Campamentos de verano, dirigido a jóvenes, entre 12 y 17 años, con la finalidad de facilitar a estas entidades la elaboración de programas de ocio educativo donde se promuevan hábitos de vida saludables y actividades de tiempo libre educativo para romper, si procede, dinámicas de desigualdad.\r\n\r\nServicios que se ofrecen:\r\n- Un programa de actividades de multiaventura, tiempo libre, actividades de ocio educativo, formativo y convivencial. En algunos se incluyen actividades náuticas e inglés. La duración depende de la actividad elegida.\r\n- Alojamiento en albergues juveniles de la Comunitat Valenciana o de otras comunidades autónomas.\r\n- Alimentación en régimen de pensión completa, en el que se incluye el desayuno, comida, merienda y cena.\r\n- Servicio especializado de animación sociocultural, en actividades náuticas y de multiaventura.\r\n- Material necesario para realizar las actividades.\r\n- Seguro de responsabilidad civil y de accidentes.\r\n\r\nEn las actividades en otras comunidades autónomas, se incluye el transporte desde Valencia, Alicante o Castellón hasta el albergue donde se alojen. En las actividades que se realizan en la Comunitat Valenciana, el o la joven que participe habrá de llegar por sus propios medios al albergue.','Se envió la subvención al grupo de jóvenes.\r\n\r\nLa dejamos para el año que viene a ver si la podemos promocionar mejor.','','-',NULL,10,9,5,NULL),(33,'2018-03-02','2018-09-15','2018-03-02 12:55:29','2018-03-02 12:55:29','xDGHjV','Convocatoria de ayudas económicas para jóvenes interesados en realizar una estancia de movilidad en países de la Unión Europea. Anualidad 2017.','http://www.gva.es/es/inicio/procedimientos?id_proc=19296','http://www.dogv.gva.es/datos/2018/02/28/pdf/2018_1507.pdf','','GV','','El objeto del Plan de movilidad es fomentar la movilidad transnacional y mejorar el nivel de empleabilidad entre los jóvenes beneficiarios del Sistema Nacional de Garantía Juvenil.\r\n\r\nEstas ayudas estarán cofinanciadas por el Fondo Social Euro-peo (FSE) y la Iniciativa de Empleo Juvenil (IEJ) dentro del Programa operativo de empleo juvenil 2014-2020','','','-',NULL,4,10,5,NULL),(34,'2018-03-01','2018-03-22','2018-03-02 13:28:28','2018-03-21 22:13:20','QX2bVx','EMCUJU- Programa de subvenciones de empleo destinadas a la contratación de personas jóvenes cualificadas por entidades locales, en el marco del Sistema Nacional de Garantía Juvenil, para el ejercicio 2018 (SERVEF)','http://www.gva.es/es/inicio/procedimientos?id_proc=18598','','http://www.dogv.gva.es/datos/2018/02/28/pdf/2018_1909.pdf','GV','31437 €','La concesión de subvenciones para la contratación de las personas jóvenes, que figuren inscritas en el fichero del Sistema Nacional de Garantía Juvenil en el ámbito territorial de la Comunitat Valenciana.','21-03-2018\r\nSeleccionamos dos.\r\nhttps://docs.google.com/document/d/1RN7e4dyRIOLQ2rvm3tuAUtxqErTPStl-izeVvSVz0s8/edit?usp=sharing\r\n\r\n---\r\n\r\nLa concesión de estas subvenciones se tramitará en régimen de concurrencia competitiva.\r\n\r\nson la gente con formación, por ahora tenía claro un par de puestos:\r\n- Mireia, está terminando Integración Social, http://www.todofp.es/que-como-y-donde-estudiar/que-estudiar/familia/loe/servicios-socioculturales-comunidad/integracion-social.html\r\n\r\n- Amos podría venir de informático. Miquel, el hijo de Miquelo, está también estudiando informática, no sé si lo tiene terminado o como lo lleva. Consultar a Amos.\r\n\r\n- dependiendo del periodo en el que empieze pensar de nuevo en Eloi\r\n\r\nmirarlo en Benidorm\r\n- Mantenimiento de Instalaciones Térmicas y de Fluidos. (fajardo mendoza) \r\n- guía, información y asistencia turísticas. (IES MEDITERRANIA, l\'Almadrava)','','-',NULL,3,11,5,NULL),(35,'2018-03-01','2018-03-22','2018-03-03 15:47:28','2018-03-23 19:30:44','DNvFYE','EMPUJU-Programa de subvenciones de empleo destinadas a la contratación de personas jóvenes por entidades locales, en el marco del Sistema Nacional de Garantía Juvenil, para el ejercicio 2018. (SERVEF)','http://www.gva.es/es/inicio/procedimientos?id_proc=18617','http://www.dogv.gva.es/datos/2018/02/28/pdf/2018_1908.pdf','','GV','56130 €','La concesión de subvenciones para la contratación de las personas jóvenes, que figuren inscritas en el fichero del Sistema Nacional de Garantía Juvenil en el ámbito territorial de la Comunitat Valenciana.','21-03-2018\r\nSeleccionamos tres.\r\nhttps://docs.google.com/document/d/1RN7e4dyRIOLQ2rvm3tuAUtxqErTPStl-izeVvSVz0s8/edit?usp=sharing\r\n\r\n-----\r\nLa concesión de estas subvenciones se tramitará en régimen de concurrencia competitiva.','','-',NULL,3,11,5,NULL),(36,'2018-03-07','2018-04-04','2018-03-07 09:02:33','2018-04-03 21:36:31','M5llcE','Subvenciones para la realización de proyectos e iniciativas en materia de recuperación de la memoria histórica en aras a la promoción de la convivencia democrática, desarrolladas por AYUNTAMIENTOS y MANCOMUNIDADES de la Comunitat Valenciana. Año 2018.','http://www.gva.es/es/inicio/procedimientos;jsessionid=lf2WhfpDJSSQ18TjjJ0ZJRvqn2y09f3l20y9qWL3LFwTCnlbBp21!2111063921!1520413155929?id_proc=18172#p_3','','','GV','','Salvaguardar, el conocimiento y difusión de la historia de la lucha de los valencianos y valencianas por sus derechos y libertades democráticas en el período que abarca desde la proclamación de la Segunda República, el 14 de abril de 1931, hasta la entrada en vigor del Estatut d\' Autonomia, el 10 de julio de 1982, en aras a la promoción de la convivencia y del aumento en la calidad de la vida democrática, desarrolladas por ayuntamientos y mancomunidades de la Comunitat Valenciana.','JC 03-04-2018: esta suena para que la mueva un alcalde.','','-',NULL,9,12,5,NULL),(37,'2018-03-06','2018-04-10','2018-03-07 09:05:52','2018-04-09 19:31:09','vW9WHJ','TECG - Solicitud de subvenciones destinadas a la realización de actividades de voluntariado ambiental en prevención de incendios forestales para el ejercicio 2018.','http://www.gva.es/es/inicio/procedimientos?id_proc=661','','','GV','>10.000','Serán subvencionables las actividades de voluntariado ambiental en materia de prevención de incendios forestales, campañas de sensibilización, de educación y concienciación a los visitantes en espacios naturales y forestales, mediante acciones dirigidas a la información a los visitantes acerca del cumplimiento de las distintas normativas aplicables, a la vigilancia disuasoria, y a la aplicación de programas de educación ambiental con especial incidencia en el conocimiento del medio forestal.\r\nLas actividades podrán desarrollarse a lo largo de todo el ejercicio 2018. En el caso de actividades realizadas con anterioridad a la presente convocatoria, para ser subvencionables deberán haberse realizado conforme lo establecido en las bases y constar el conocimiento y autorización por parte de la Conselleria de Agricultura , Medio Ambiente, Cambio Climático y Desarrollo Rural.','JC: 03-04-2018: creo que sería asumible para el año 2019. habría que trabajarlo de todas maneras conjuntamente JOVES, trabajadores forestales.','','-',NULL,10,3,5,NULL),(38,'2018-03-08','2018-03-28','2018-03-08 12:43:18','2018-03-16 00:31:51','E5vN5X','Subvenciones a escuelas de danza dependientes de corporaciones locales o de entidades privadas sin ánimo de lucro de la Comunitat Valenciana para el ejercicio 2018','http://www.gva.es/es/inicio/procedimientos?id_proc=18146','','','GV','','Convocar subvenciones a escuelas de danza de la Comunitat Valenciana, para contribuir a la financiación parcial de estos centros durante el curso académico 2017-2018.','- Figurar inscritas como tales en la sección específica del Registro de Centros Docentes de la Comunitat Valenciana. Las escuelas deben haber solicitado la inscripción antes de la finalización del año de inicio del curso escolar de referencia en la convocatoria de subvención.\r\n- Que el primer día hábil del mes de noviembre del año de inicio del curso escolar de referencia en la convocatoria de subvención, esté iniciada la actividad de la escuela.\r\n- Disponer del número mínimo de profesorado establecido en la normativa vigente reguladora de estos centros. A la hora de otorgar la subvención solo se considerará el profesorado contratado y dado de alta en la Seguridad Social con efecto, al menos, del primer día hábil del mes de noviembre del año de inicio del curso escolar de referencia en la convocatoria de subvención. El profesorado contratado que ejerza otro puesto de trabajo en otro servicio público deberá cumplir con lo que se establece en la normativa vigente sobre incompatibilidades del personal al servicio de las Administraciones Públicas.\r\n- Que el profesorado disponga del requisito de titulación señalado en la normativa vigente reguladora de estos centros.\r\n- Cumplir con todo aquello que establezca la normativa vigente reguladora de estos centros.\r\n- Que la entidad solicitante se encuentra al corriente en el cumplimiento de las obligaciones tributarias y ante la Seguridad Social.\r\n-----','','-',NULL,2,13,5,NULL),(39,'2018-03-08','2018-03-28','2018-03-08 12:46:49','2018-04-06 19:53:35','DVO95p','Subvenciones destinadas a escuelas de música y escuelas de música y danza, dependientes de corporaciones locales o de entidades privadas sin ánimo de lucro de la Comunitat Valenciana para el ejercicio 2018.','http://www.gva.es/es/inicio/procedimientos?id_proc=230','','','GV','','- Figurar inscritas como tales en la sección específica del Registro de Centros Docentes de la Comunitat Valenciana. Las escuelas deben haber solicitado la inscripción antes de la finalización del año de inicio del curso escolar de referencia en la convocatoria de subvención.\r\n\r\n- Que el primer día hábil del mes de noviembre del año de inicio del curso escolar de referencia en la convocatoria de subvención, esté iniciada la actividad de la escuela.\r\n\r\n- Disponer del número mínimo de profesorado establecido en la normativa vigente reguladora de estos centros. A la hora de otorgar la subvención solo se considerará el profesorado contratado y dado de alta en la Seguridad Social con efecto, al menos, del primer día hábil del mes de noviembre del año de inicio del curso escolar de referencia en la convocatoria de subvención. El profesorado contratado que ejerza otro puesto de trabajo en otro servicio público deberá cumplir con lo que se establece en la normativa vigente sobre incompatibilidades del personal al servicio de las Administraciones Públicas.\r\n\r\n- Que el profesorado disponga del requisito de titulación señalado en la normativa vigente reguladora de estos centros.\r\n\r\n- Cumplir con todo aquello que establezca la normativa vigente reguladora de estos centros.\r\n\r\n- Que la entidad solicitante se encuentra al corriente en el cumplimiento de las obligaciones tributarias y ante la Seguridad Social.','verlo en la fireta con Nazari','','-',NULL,8,13,5,NULL),(40,'2018-03-01','2018-04-03','2018-03-08 12:54:49','2018-04-03 21:18:56','Lo8gQm','Plan Ayudas a Ayuntamientos de la Provincia, EATIM y Entidades Deportivas Municipales dependientes de los mismos.','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00060.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00058.pdf','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=94','DA','2.250,00 €','Ayudas económicas a los Ayuntamientos y/o Entidades Locales de la Provincia de Alicante, así como a las Entidades Deportivas Ayuntamientos, EATIM, Entidades Deportivas Municipales, dependientes de los mismos (Patronatos, Organismos Autónomos Fundaciones Deportivas, etc.), para la realización de actividades deportivas o para el funcionamiento de escuelas deportivas municipales.','el año 2017 se pidio la escola de estiu.\r\nhay que ver que es exactamente eso.\r\n\r\n28-03-2018 - María Vicenta ha pedido la escola. Para el año que viene habrá que ver si seguimos con esto o no. En mi opinión debería ir a algo que tenga que ver con deportes y no la escola d\'estiu.','','3/2018 - 14',7,1,NULL,5,NULL),(41,'2018-03-01','2018-03-20','2018-03-08 13:20:27','2018-03-16 13:46:46','9xSchn','Programa de Actividad Física para Mayores','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00058.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00060.pdf','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=99','DA','< 1.200 €','Realización de cursos de actividad física moderada en todos los municipios de la Provincia de Alicante con menos de 5000 habitantes, y cuya finalidad será la de impulsar la práctica estable de actividades físico-deportivas entre la población de más edad, contribuyendo a una mejor calidad de vida y mejora de la salud de nuestros mayores.','Personas, preferentemente, mayores de 60 años, residentes en Municipios de la Provincia de Alicante con menos de 5000 habitantes\r\n\r\npedido el 16/03/2018\r\n\r\nyoga. los martes por la tarde.\r\n\r\ndura unos dos meses y medio. tres','','3/2018 - 13',7,1,NULL,5,NULL),(42,'2018-03-01','2018-03-20','2018-03-08 13:23:57','2018-03-16 13:31:38','ndTtcG','Ayudas para la promoción de cursos de natación.','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00063.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00056.pdf','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=206','DA','< 1.200 €','Ayuda a Ayuntamientos y EATIM, menores de 5.000 habitantes, para la realización de Cursos de Natación - niveles de Iniciación y Perfeccionamiento-.\r\n\r\nNiños de los municipios de Alicante menores de 5.000 habitantes, con edades comprendidas entre 4 y 14 años sea la enseñanza de la natación en sus diferentes fases de aprendizaje: principios básicos, iniciación a los diferentes estilos y perfeccionamiento técnico.','Traducionalmente gestionada por Mariló. \r\nJulio 2017 . Aprobada 66,75 % ( 1230 €) \r\n\r\n\r\npedido el 16/03/2018','https://drive.google.com/open?id=1MoR8PbJNkHkY3Yy1t_ySye-CD9PBR_jN','-',7,1,NULL,5,NULL),(43,'2018-03-13','2018-04-03','2018-03-14 06:38:24','2018-04-16 18:58:49','Ikbupr','Solicitud de subvenciones destinadas a financiar la remodelación y construcción de locales sociales de las sociedades musicales de la Comunitat Valenciana para el ejercicio 2018.','http://www.gva.es/es/inicio/procedimientos?id_proc=15734','','','GV','> 12.000 €','Modalidad remodelación: incluye obras de remodelación y rehabilitación, reforma, mejora, adecuación y modernización de locales sociales en espacios existentes y sus instalaciones.','<p>Sociedades musicales de la Comunitat Valenciana</p>','','-',NULL,8,13,5,NULL),(44,'2018-03-15','2018-03-30','2018-03-15 07:12:31','2018-04-27 05:45:36','8x2yJz','Solicitud de ayudas destinadas a ayuntamientos, mancomunidades de municipios y entidades locales menores de la Comunidad Valenciana y de El Carche que realizan actividades de promoción del uso del valenciano.','http://www.gva.es/es/inicio/procedimientos?id_proc=3219','','','GV','','Las ayudas van dirigidas a subvencionar la realización de programas y actividades de promoción del uso oficial y social del valenciano en el período comprendido entre el 9 de noviembre de 2017, fecha de finalización de la justificación de la convocatoria de subvenciones del año 2017, hasta el 31 de diciembre de 2018.\r\n\r\n2. Programas solicitados.\r\na) Rotulaciones y señalizaciones.\r\nb) Cursos de valenciano.\r\nc) Campañas y acciones de voluntariado lingüístico.\r\nd) Campañas y acciones de acogida lingüística a recién llegados.\r\ne) Actividades culturales.\r\nf) Acciones, actividades y campañas municipales de sensibilización y promoción del uso del valenciano.\r\ng) Creación y funcionamiento de oficinas o servicios de promoción del valenciano.\r\nh) Cláusulas sociales. Disponer de un plan de igualdad y de integración social.\r\ni) Programa del uso del valenciano en las redes sociales de la entidad.','<p>JC: 3-4-2018: Podr&iacute;amos haber pedido un curso de valenciano y actividades culturales en general, pero... &iquest;alguien sabe algo del concejal de cultura? yo no puedo gestionar todas las subvenciones -----</p>','','-',NULL,4,13,5,NULL),(45,'2018-03-16','2018-04-27','2018-03-16 07:47:42','2018-04-16 20:31:56','khEIdA','TECG - Solicitud de ayudas para obras de acondicionamiento de caminos rurales de titularidad de los municipios y entidades locales menores de la Comunidad Valenciana.','http://www.gva.es/es/inicio/procedimientos?id_proc=796','https://www.dogv.gva.es/datos/2018/03/15/pdf/2018_2640.pdf','https://www.dogv.gva.es/datos/2008/11/27/pdf/2008_13750.pdf','GV','< 160.000 80%','La subvención tiene la finalidad de mejorar la infraestructura viaria rural de titularidad municipal Serán obras subvencionables todas aquellas que signifiquen una mejora permanente de la superestructura de los caminos rurales, bien con firme asfáltico, de hormigón o de material granular.\r\nQuedan exceptuados los proyectos que contemplen exclusivamente obras aisladas no incluidas en las de superestructura, y trabajos como los de desyerbe o limpieza de caminos, bacheos y rasanteos aislados.\r\nAdemás, se considerará una inversión desproporcionada a los fines de la ayuda, aquella en que el presupuesto de la mejora de la superestructura de los caminos rurales sea inferior al 60% del presupuesto total de la obra. estas solicitudes, podrá ser reducidas o denegadas.\r\nNo serán auxiliables las mejoras ofertadas por los contratistas.\r\n* Una vez presentada la solicitud, en caso de querer aportar documentos al expediente (AGMIA) se podrá hacer a través del enlace que aparece en el apartado de Información complementaria.','<p>JC: 16-04-2018: Env&iacute;o recordatorio a Josemi, con el usuario y pass para entrar a esta herramienta de subvenciones. Hace unos d&iacute;as le envi&eacute; los datos de la carretera.</p>\r\n<p>JC: 10/04/2018: hablo con Josemi. Creo expediente en gestiona y empiezo a mirar que nos har&aacute; falta. Estos es la documentaci&oacute;n a presentar: - Certificado del municipio o de la entidad local menor, seg&uacute;n la naturaleza del solicitante, en modelo normalizado. - Memoria valorada, firmada digitalmente por persona t&eacute;cnica competente, con un tama&ntilde;o m&aacute;ximo de 5 MB. En vez de la memoria valorada, tambi&eacute;n podr&aacute; presentarse un proyecto t&eacute;cnico, firmado digitalmente, aunque &eacute;ste s&oacute;lo ser&aacute; exigible, posteriormente, a aquellas solicitudes que resulten seleccionadas para su aprobaci&oacute;n. Ambos documentos se ajustar&aacute;n a lo indicado en la Orden 9/2016, de 22 de abril de 2016, de la Conselleria de Agricultura, Medioambiente, Cambio Clim&aacute;tico y Desarrollo Rural, por la que se establece el formato digital para la presentaci&oacute;n de proyectos t&eacute;cnicos. - Memoria acreditativa de la necesidad de la obra, firmada digitalmente, con un tama&ntilde;o m&aacute;ximo de 5 MB. Como m&iacute;nimo, declarar&aacute; y acreditar&aacute; suficientemente la informaci&oacute;n necesaria para poder valorar los siguientes apartados para la priorizaci&oacute;n de la solicitud: a) Indicar si la solicitud contempla &uacute;nicamente inversiones en caminos intermunicipales o en caminos que den servicio directo a zonas de cultivo o explotaci&oacute;n en com&uacute;n. b) Indicar si se da acceso directo a explotaciones ganaderas o a industrias agroalimentarias (bodegas, cooperativas). c) Indicar si existe coherencia con otras l&iacute;neas de subvenci&oacute;n o actuaciones directas de la Conselleria, tales como modernizaci&oacute;n de regad&iacute;os, mejora de infraestructuras ganaderas o cualesquiera otras d) Detallar la necesidad de la obra en base a la poblaci&oacute;n rural y las producciones de la zona a que da servicio el camino o caminos, o cualquier otro factor que contribuya al desarrollo rural de la zona. - En caso de que alg&uacute;n camino objeto de la solicitud, discurra por cualquier zona de afecci&oacute;n (v&iacute;a pecuaria, dominio p&uacute;blico hidr&aacute;ulico, carreteras, espacios de la red Natura 2000 o parajes naturales declarados, etc) se adjuntar&aacute; la autorizaci&oacute;n de ejecuci&oacute;n de la obra, expedida por el &oacute;rgano competente. - En caso de que la cuenta indicada para el pago de la ayuda no est&eacute; dada de alta en la Generalitat, modelo de domiciliaci&oacute;n bancaria, firmado digitalmente, en modelo normalizado ------------------------------------------------------------------------------------------------------------ Menos de 2000 habitantes: 80%. Rafalet El expediente del camino del buscarr&oacute; 13/2015 Haciendo una extrapolaci&oacute;n: El camino del buscarr&oacute; cost&oacute; 60.000 ya con todos los gastos e impuesto, sindo 1316 metros. En Rafalet, el tramo m&iacute;nimo a realizar ser&iacute;a (1001 + 724). desde coll de sa Creu a la curva de Malagana. Y haciendo una regla de tres me sale 80.000&euro;, siendo 15.000 el 20%</p>','','3/2018 - 23',NULL,4,3,5,NULL),(46,'2017-11-28','2017-12-28','2018-03-16 08:27:34','2018-03-16 08:27:34','gefaou','Subvenciones para realización de inventarios de emisiones de referencia....','http://www.dip-alicante.es/MERI/DOC/SUBVENCION/BASES/BASES%20INVENTARIOS%20DE%20EMISIONES.pdf','','','DA','482 €','(16/03/2018) - está aprobada, nos ayudan con 482€.\r\n\r\nahora hay que ver como se hace esto','mirar como gestionar este dinero y ver las otras líneas que había.','https://drive.google.com/open?id=0B-6ZND28b8BsanR3QjlPZ2xEbUk','-',8,5,NULL,5,NULL),(47,'2018-03-08','2018-03-29','2018-03-16 09:10:15','2018-04-14 11:05:24','Bj75Zr','Subvenciones a Ayuntamientos y Entidades de ámbito territorial inferior al municipio (E.A.T.I.M.) para actividades y programas dirigidos a la juventud','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00072.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00066.pdf','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=212','DA','< 3000 €','Serán objeto de subvención de la presente convocatoria, todas aquellas actividades y\r\nprogramas que vayan dirigidos exclusivamente a la juventud, entendiéndose como tal la\r\nfranja de población comprendida entre los 12 y los 30 años.','el 29/03/2018 parece que se envió la subvención pero no encuentro minuta en el gestiona.\r\n\r\nel año pasado se pidió el tema de la escalada.\r\nsigo pensando en que Girado podría iniciar una escuela deportiva.\r\n\r\n26-03-2018, llamar a Girado\r\nenviar 