Quemos a la espera para enviar la solicitud ma&ntilde;ana.</p>\r\n<p>JC: 10-04-2018: le pido a Agnieszka que haga una memoria de las actividades que hemos ido desarrollando. La idea es seguir contando con TEO. Viniendo un d&iacute;a todas las semanas del a&ntilde;o sale 2240 &euro;+iva. Teniendo en cuenta que se subvenciona 3500. es una buena opci&oacute;n. 28-03-2018. El a&ntilde;o pasado se pidi&oacute; el curso de valenciano. La verdad es que al final los extranjeros lo han ido dejando porque no les gust&oacute; el m&eacute;todo de la profesora. tendr&iacute;amos dos opciones: - Ser&iacute;a interesante saber cuanto ha durado el curso de valenciano. - por otro lado podr&iacute;amos usar esta subvenci&oacute;n para el huerto ecol&oacute;gico. Aunque tambi&eacute;n podr&iacute;amos esperar a que saliera la de agricultura.</p>','https://drive.google.com/open?id=0B-6ZND28b8BsYWxFN0l0S2N4QlE','3/2018 EXP. 20',10,1,NULL,5,NULL),(50,'2018-03-08','2018-03-29','2018-03-28 10:06:43','2018-03-28 10:06:43','LL2MtC','Subvenciones a Mancomunidades con destino a programas y actividades para la igualdad de oportunidades y prevención de la violencia de género','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=112','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00070.pdf','','DA','< 2.500 €','Subvenciones para la realización de actividades en materia de igualdad y violencia de género, para la elaboración o implantación de planes de igualdad, para la realización de actividades en materia de juventud y prevención de drogodependencias','No tengo ni idea lo que se ha pedido. Preguntar en el próximo pleno.','','-',9,9,NULL,5,NULL),(51,'2018-03-17','2018-05-16','2018-03-28 10:21:26','2018-04-10 17:49:29','vfwmlE','Ayudas a las Obras y Servicios de Competencia Municipal para 2019','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00078.pdf','','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=122','DA','240.000 € 95%','La colaboración con los municipios se materializa a través de diversos Programas Provinciales de Cooperación aprobados anualmente por la Diputación, centrándose, fundamentalmente, en los servicios municipales obligatorios y, dentro de éstos, en los que se pueden considerar como básicos: abastecimiento de agua potable, saneamiento de aguas residuales, tratamiento de residuos sólidos, alumbrado público o pavimentación, entre otros, y en general los establecidos en el art. 26.1 de la Ley 7/1985 Reguladora de Bases de Régimen Local. Los Programas de Cooperación Provincial en los que se centra esta Oficina son: \r\n- Plan Provincial de Obras y Servicios de Competencia Municipal. \r\n- Plan Complementario al de Obras y Servicios de Competencia Municipal. \r\n- Plan Especial de Infraestructuras Dotacionales. \r\n- Plan de ahorro Energético en colaboración con la Agencia Provincial de la Energía. \r\n- Subvenciones para inversiones en obras, reparaciones y equipamiento de cooperación municipal.','','','-',3,4,NULL,5,NULL),(52,'2018-03-17','2018-04-05','2018-03-28 10:31:25','2018-04-16 19:00:38','L40Mjc','Ayudas a municipios de la provincia de Alicante, Promoción Turística de la Costa Blanca, anualidad 2018','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00077.pdf','','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=217','DA','','Regular el procedimiento en régimen de concurrencia competitiva ordinaria para la concesión de subvenciones destinada a coadyuvar en la financiación de los gastos derivados en la promoción turística de la Costa Blanca','<p>JC: 16-04-2018: Al final la convocator&iacute;a incorporaba en una sola todas las l&iacute;neas de subvenci&oacute;n de a&ntilde;os anteriores. As&iacute; que al final solo se pidi&oacute; la de radio. Reservaremos algo para alg&uacute;n folleto.</p>\r\n<p>se suele pedir radio, carteles, tr&iacute;ptico. el a&ntilde;o pasado se concedi&oacute; 1921,77 &euro; (64,06%) creo que podemos seguir pidien