ara la igualdad de oportunidades y prevención de la violencia de género','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=215','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00075.pdf','','DA','< 2.500 €','4.1.- Serán subvencionables aquellas actuaciones de fomento de la igualdad de\r\ngénero relacionadas con los programas y áreas descritas a continuación:\r\n1.- prevención y erradicación de la violencia de género;\r\n2.- formación y/o promoción de empleo de las mujeres, especialmente aquellas que se\r\nencuentran en situación de especial vulnerabilidad;\r\n3.- actuaciones tendentes a la ruptura de roles y estereotipos de género tradicionales,\r\nfomentando el empoderamiento y la participación de las mujeres en la vida pública en\r\ncondiciones de igualdad con respecto los hombres;\r\n4.- actividades dirigidas a la investigación, formación, información y sensibilización\r\nsobre las desigualdades de género incluyendo aquellas actuaciones tendentes al\r\nfomento de las nuevas masculinidades y la promoción de la igualdad de trato y no\r\ndiscriminación por motivos de identidad de género y orientación sexual;\r\n5.- acciones formativas en igualdad de género dirigidas al personal de la entidad\r\nbeneficiaria;\r\n6.- corresponsabilidad doméstica y conciliación de la vida personal, familiar y laboral\r\nde las personas trabajadoras fuera del hogar;\r\n7.- promoción de la inclusión social de algunos colectivos de mujeres en situación de\r\nespecial vulnerabilidad, como las pertenecientes a minorías étnicas, reclusas, víctimas\r\nde violencia de género, de familias monomarentales, etc.\r\n8.- promoción de la salud y la mejora de la calidad de vida de las mujeres no\r\nexcluidas expresamente en la base quinta de esta convocatoria.\r\n4.2.- Podrán ser objeto de subvención, los gastos siguientes:\r\n- Gastos derivados de la organización y ejecución de programas, proyectos y/o\r\nactividades dirigidos a fomentar la igualdad de oportunidades y la prevención\r\nde la violencia de género, incluyendo aquí los gastos del personal destinado a\r\nla ejecución del programa y/o actividad subvencionada, salvo lo establecido en\r\nla base quinta.\r\n- Gastos de alquiler de salas y/o espacios destinados únicamente a la ejecución\r\nde los programas objeto de subvención, siempre y cuando sean distintos de la\r\nsede social de la entidad solicitante.\r\n- Gastos financieros, de asesoría jurídica o financiera, los gastos notariales y\r\nregistrales y los gastos periciales para la realización del proyecto\r\nsubvencionado siempre que estén directamente relacionados con la actividad\r\nsubvencionada y sean indispensables para la adecuada preparación o ejecución\r\nde la misma de acuerdo con el apartado 7 del artículo 31 de la Ley 38/2003, de\r\n17 de noviembre, General de Subvenciones (en adelante LGS).','Hasta que no tengamos ONG en marcha o Joves.....','','-',9,10,NULL,5,NULL),(59,'2018-03-21','2018-04-04','2018-03-28 11:43:56','2018-04-03 21:38:55','OACTF6','Subvenciones a Asociaciones de Madres y Padres del Alumnado de centros educativos de primaria y/o secundaria para la realización proyectos coeducativos','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=218','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00079.pdf','','DA','< 2.500 €','Subvenciones a Asociaciones de Madres y Padres del Alumnado de centros educativos de primaria y/o secundaria de la provincia de Alicante con destino a la realización de proyectos coeducativos\r\n\r\nDestinatarios:	Asociaciones de Madres y Padres del Alumnado de Centros Educativos','- Los gastos de honorarios de colaboradores/as externos procedentes de la\r\nrealización de talleres, ponencias, conferencias…\r\n- Los gastos relacionados con el alquiler de espacios y elementos técnicos\r\nnecesarios para el desarrollo de la actividad propuesta.\r\n- La adquisición de material didáctico de coeducación como soporte para la\r\nrealización de las actividades propuestas.\r\n- Gastos financieros, de asesoría jurídica o financiera, los gastos notariales y\r\nregistrales y los gastos periciales para la realización del proyecto\r\nsubvencionado siempre que estén directamente relacionados con la actividad\r\nsubvencionada y sean indispensables para la adecuada preparación o ejecución\r\nde la misma de acuerdo con el apartado 7 del artículo 31 de la Ley 38/2003, de\r\n17 de noviembre, General de Subvenciones (en adelante LGS).\r\n- En general, los gastos corrientes relacionados con el objeto de la subvención y\r\nque no estén excluidos expresamente en la base sexta de la convocatoria.','','-',9,9,NULL,5,NULL),(60,'2018-03-17','2018-04-05','2018-03-28 11:47:21','2018-04-03 21:42:00','kLpqa7','Subvenciones a Entidades sin ánimo de lucro para la Promoción Turística de la Costa Blanca, anualidad 2018','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=216','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00076.pdf','','DA','< 12.000 € 80%','Regular el procedimiento en régimen de concurrencia competitiva ordinaria para la concesión de subvenciones destinadas a coadyuvar en la financiación de los gastos derivados en la promoción turística de la Costa Blanca','Edición e Impresión de material promocional turístico\r\n• Desarrollo de campañas de promoción turística en redes sociales, entre las que cabe destacar facebook, twitt, insta, you\r\n• Acciones promocionales en los siguientes productos turísticos que ayuden a vertebrar iniciativas en el territorio o reducir la estacionalidad del turismo de la Costa Blanca: Gastronomía, Cultural, Industrial, Oferta Complementaria y Turismo Residencial.\r\n\r\nJC: 03-04-2018: Pues cuando tengamos la asociación de Jóvenes o finalmente Amics museo, o ...','','-',11,10,NULL,5,NULL),(61,'2018-02-22','2018-04-16','2018-03-28 11:49:34','2018-04-06 19:57:56','3QPYcp','Ayudas a Revistas para el año 2018','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=203','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00057.pdf','','DA','< 1.800 €','El apoyo a la difusión cultural y contribución al enriquecimiento del patrimonio bibliográfico alicantino.','Para  asociaciones culturales. Comentarlo con CERM y AMICS.\r\n\r\nnecesitamos un concejal de cultura','','-',12,10,NULL,5,NULL),(62,'2018-03-30','2018-04-18','2018-03-29 08:44:14','2018-04-20 16:23:29','kXCux9','plan ayudas a municipios de la provincia de alicante con población inferior a 5000 hab. para adquisición de equipamiento y material deportivo 2018','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=222','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00084.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00079.pdf','DA','< 3000 €','adquisición, durante la anualidad 2018, de equipamiento y/o material deportivo necesarios para el desarrollo del deporte y la práctica de la actividad física en sus diferentes espacios deportivos','<p>JC: 20-04-2018: enviado el d&iacute;a 18 a las 9:46. De todas maneras lo pongo con detalles por definir, porque ha aparecido una porter&iacute;a y por tanto puede que <strong>solo necesitemos comprar dos</strong>. y por tanto necesitaremos <strong>cambiar</strong> el presupuesto <strong>por otra cosa</strong>.</p>\r\n<p>JC: 17-04-2018: Enviado a firmar por MVicenta.</p>\r\n<p>JC: 16-04-2018: Agnieszka termina la memor&iacute;a deportiva y rellena el formulario de solicitud. Ma&ntilde;ana tengo que pedir a MVicenta que lo suba a gestiona y pase por firma.</p>\r\n<p>JC: 9-03-2018 - enviada propuesta a cuatro empresas. Financiable: juego de canastas fijas o m&oacute;viles homologadas de diversas modalidades deportivas, juego de porter&iacute;as conredes fijas o m&oacute;viles homologadas de diversas modalidades deportivas, postes y redes fijos o m&oacute;viles homologados de diversas modalidades deportivas, mesas homologadas de tenis de mesa, mesas anti vand&aacute;licas de exterior para tenis de mesa y ajedrez, tatamis y colchonetas para artes marciales, tapices para gimnasia, corcheras para piscina, aparatos de cardio para gimnasios, material y equipos de musculaci&oacute;n, aparatos de gimnasia, etc. y otros elementos anexos a estos como contrapesos, conjunto de tableros y aro de baloncesto, redes de protecci&oacute;n, banquillo para jugadores, marcadores electr&oacute;nicos, desfibriladores, etc.), incluyendo el necesario para dar un servicio adecuado en espacios anexos como los vestuarios (taquillas, bancos, etc.). ---- a&ntilde;o 2017 2646 &euro; ( 63,04 % - 4197,20 &euro;) Carmen. MVicenta APROBADA. 2 bicicletas est&aacute;ticas . ---- PARA LA PISCINA: - 2 bancos de esos con perchas - 4 bancos peque&ntilde;os para dentro de los vestidores PARA PISTA DEPORTIVA COLEGIO - 2 canastas grandes - 2 porter&iacute;as futbito PARA PISTA DEPORTIVA CASA CULTURA - 2 porterias futbito</p>','https://drive.google.com/open?id=0B-6ZND28b8BsVTBXbHBiNEljZ0k','3/2018 EXP. 25',7,3,NULL,5,NULL),(63,'2018-03-28','2018-04-25','2018-04-06 12:27:09','2018-04-25 06:46:31','ikO42a','cursos del área de emergencias, para el año 2018 del personal de los servicios de intervención frente a emergencias contemplados en la Ley 13/2010, de 23 de noviembre, de la Generalitat, de Protección Civil y Emergencias','http://www.gva.es/es/inicio/procedimientos?id_proc=15178','http://www.dogv.gva.es/datos/2018/03/28/pdf/2018_3113.pdf','','GV','','Se podrán formular las solicitudes de forma individual, salvo en los casos de los cursos destinados a Bomberos Voluntarios, miembros de las Agrupaciones Locales de Voluntarios de Protección Civil y miembros de asociaciones y de entidades que colaboren en las labores de protección civil, donde serán los Consorcios Provinciales de Bomberos, los ayuntamientos y las entidades de que dependa, quienes formulen las solicitudes.','<p>JC: 25-04-2018: tenemos que seguir insistiendo con el tema de crear un grupo de voluntarios de protecci&oacute;n civil.</p>\r\n<p>Los objetivos generales de los diferentes cursos que se convocan, son los siguientes: a) Dotar al alumnado participante en los cursos de un adecuado y actualizado nivel de conocimientos profesionales. b) Proporcionar al alumnado participante las herramientas necesarias para llevar a la pr&aacute;ctica los conocimientos te&oacute;ricos impartidos. c) Adiestrar a los destinatarios participantes en los cometidos de la gesti&oacute;n de emergencias. d) Actualizar los conocimientos t&eacute;cnicos, normativos y legislativos en las distintas &aacute;reas para llevar a cabo sus funciones con eficacia y garant&iacute;a jur&iacute;dica. e) Sensibilizar a los participantes respecto a los diferentes factores que condicionan la eficacia del trabajo. f) Desarrollar los conocimientos y habilidades necesarios para optimizar las relaciones interpersonales en su trabajo y conocer y practicar estrategias y t&aacute;cticas de comunicaci&oacute;n interpersonal que permitan resolver, de manera eficaz, las situaciones de crisis. g) Entrenar al alumnado en h&aacute;bitos para intervenciones profesionales haciendo un uso correcto de sus capacidades. h) Dar a conocer los instrumentos necesarios que permitan el procesamiento de informaci&oacute;n y documentaci&oacute;n b&aacute;sicas de la gesti&oacute;n de emergencias, as&iacute; como las habilidades para el manejo de las nuevas telecomunicaciones.</p>','','-',NULL,10,14,5,NULL),(64,'2018-03-27','2018-04-26','2018-04-06 12:33:33','2018-04-27 08:26:21','bpin9u','Subvenciones destinadas a las entidades locales de la Comunitat Valenciana hasta 5.000 habitantes, para el fomento de la participación ciudadana, la transparencia y el acceso a la información pública, durante el ejercicio 2018','http://www.gva.es/es/inicio/procedimientos;jsessionid=hlw6h7yhNfmGfxM2XhFcbMjyWHZbvk3X2JhM2TlKJlVx03CHWHZ1!295945142!1522217498940?id_proc=19282','','','GV','5.000 €','Facilitar el cumplimiento de los objetivos establecidos tanto en la ley estatal 19/2013 de 9 de diciembre, de Transparencia, Acceso a la Información Pública y Buen Gobierno, como en la ley autonómica 2/2015 de 2 de abril, de Transparencia, Buen Gobierno y Participación Ciudadana, mediante la realización de proyectos o actuaciones concretas que promuevan la participación local ciudadana, tanto individual como colectiva, el fomento del asociacionismo, la transparencia de la actividad pública y el acceso de la ciudadanía a la información pública.','<p>JC: 27-04-2018: se firma y se env&iacute;a telem&aacute;ticamente. 26/04/2018 14.07.54 GVRTE - GV13SUGUS</p>\r\n<p>JC: 26-04-2018: terminamos de rellenar los formularios y los enviamos a Thierry para que firme. Llamo a Thierry para que firme.&nbsp;</p>\r\n<p>JC: 25/04/2018: estuve hablando con Irene, su segunda. Me explic&oacute; como poner los conceptos monetarios. Esta tarde he terminado de rellenar el formulario de presentaci&oacute;n del proyecto. Modalidad 2. Lo he subido al gestiona y env&iacute;o correo a @MVicenta para que ma&ntilde;ana lo terminemos y lo enviemos.</p>\r\n<p>JC: 24/04/2018: llamo a Ana Rodenas. Me llamar&aacute; su responsable de Participaci&oacute;n ciudadana.</p>\r\n<p>JC: 22/04/2018: a lo largo del fin de semana he ido rellenando el formulario de la modalidad 2. Hoy espero recibir la propuesta de la modalidad 2. Tengo que hablar con @MVicenta a ver si tenemos todo el papeleo necesario para poderla enviar.</p>\r\n<p>JC: 20-04-2018: me he leido la ORDEN 4/2016, de 3 de junio de 2016. Est&aacute; un poco cogido con pinzas lo del mural sino involucramos a las distintas asociaciones: amas de casa, j&oacute;venes, amics des museu, empresarios. Esto al menos para la modalidad I. Para redondearlo tendr&iacute;amos que traer a alg&uacute;n experto en asociaciones como el amigo de Angela del Campello.&nbsp;</p>\r\n<p>Respecto a la modalidad II, aunque las especifciaciones ponen m&aacute;s enfasis en la transparencia, bien podr&iacute;amos reforzar los cuatro puntos de la nueva pol&iacute;tica: transparentcia, reutilizaci&oacute;n datos, buen gobierno y toma de decisiones.</p>\r\n<p>JC: 10-04-2018: Se me ocurre que la subvenci&oacute;n podr&iacute;a ir por otra vertiente: - MODALIDAD 2 (entre otras) &middot; la elaboraci&oacute;n de otras herramientas que potencien la transparencia y el acceso de los ciudadanos a la informaci&oacute;n p&uacute;blica &middot; elaboraci&oacute;n de procedimientos telem&aacute;ticos para garantizar el libre acceso de los ciudadanos/as a la informaci&oacute;n Podr&iacute;a pagarnos un 40% de la n&oacute;mina de Amos. Vamos generando interfaces y -MODALIDAD 1 &middot; Proyectos y actuaciones que fomenten la participaci&oacute;n ciudadana y el fortalecimiento del tejido asociativo (modalidad 1). &middot; para la asociaci&oacute;n de j&oacute;venes. pintar un mural en donde el blanco. Juntar esto con los participantes del curso de pintura y Toni Ferri y agitamos. Env&iacute;o correo @ferri para ver si puede coordinar con el resto de pintores del pueblo unas jornadas de convivencia y pintar un mural. As&iacute; que hay que optar por las dos</p>','https://drive.google.com/open?id=1JzmsyTiY7_3IqPGndm--alCVQXeobUGW','3/2018 EXP. 30',NULL,4,4,5,NULL),(65,'2018-03-29','2018-04-23','2018-04-06 21:35:46','2018-04-23 07:31:03','zD3lJz','Solicitud de ayudas del programa mixto de empleo-formación Talleres de Empleo para el ejercicio 2018','http://www.gva.es/es/inicio/procedimientos?id_proc=19286','http://www.dogv.gva.es/datos/2016/07/20/pdf/2016_5792.pdf','','GV','','El programa de Talleres de Empleo se configura como un programa mixto de empleo y formación que tiene por objeto mejorar la empleabilidad de las personas desempleadas a las que va dirigido, mediante la realización de obras o servicios de interés general y/o social que posibiliten al alumnado/trabajador la realización de un trabajo efectivo mediante el contrato para la formación y el aprendizaje, que junto con la formación profesional para el empleo recibida, procure su cualificación profesional y favorezca su inserción laboral.','<p>JC: 23/04/2018: seguimos sin tiempo para definir toda la documentaci&oacute;n necesaria, adem&aacute;s seguimos sin local para el proyecto. Afortunadamente tenemos suficientes operarios para ir tirando. Probamos para la edici&oacute;n 2019.</p>\r\n<p>DESTINATARIOS: Las personas destinatarias de este programa deber&aacute;n cumplir los siguientes requisitos m&iacute;nimos: a) Ser mayor de 25 a&ntilde;os. b) Ser desempleadas, entendi&eacute;ndose como tales a las demandantes de empleo no ocupadas, registradas en un servicio p&uacute;blico de empleo. c) Cumplir los requisitos establecidos en la normativa de aplicaci&oacute;n para formalizar un contrato para la formaci&oacute;n y el aprendizaje. Con car&aacute;cter general, y siempre que cumplan los requisitos m&iacute;nimos exigidos, tendr&aacute;n la consideraci&oacute;n de colectivos prioritarios: las mujeres, en especial las v&iacute;ctimas de violencia de g&eacute;nero, las personas con discapacidad, las personas en situaci&oacute;n o riesgo de exclusi&oacute;n social, las personas mayores de 55 a&ntilde;os, las personas con baja cualificaci&oacute;n y las personas en paro de larga duraci&oacute;n.</p>','','-',NULL,10,6,5,NULL),(66,'2018-03-29','2018-04-29','2018-04-06 21:42:08','2018-04-06 21:42:08','Hx9Kb3','Subvención para intervención arquitectónica en locales destinados a prestación de asistencia sanitaria en municipios de la Comunidad Valenciana. PIAC','http://www.gva.es/es/inicio/procedimientos?id_proc=19364','http://www.dogv.gva.es/datos/2017/09/25/pdf/2017_8284.pdf','','GV','100.000 €','Las subvenciones que se otorguen tendrán la consideración de subvención a fondo perdido, siendo el porcentaje de subvención a aplicar hasta el 100% del importe solicitado, con un límite de 100.000,00 por proyecto, sin que este pueda superar al coste de ejecución del correspondiente proyecto aprobado o el de adjudicación. El número máximo de proyectos subvencionables en cada convocatoria por ayuntamiento será de dos.','Se entenderá por actuaciones de intervención arquitectónica las obras de reforma, reparación, restauración y rehabilitación, así como \r\nlas de conservación y mantenimiento.\r\n\r\nEl importe de la subvención no podrá, en ningún caso, ser de tal cuantía que, aisladamente o en concurrencia con otras subvenciones \r\nde cualquier procedencia, supere el coste real de la obra para la que se concede la subvención','','-',NULL,4,15,5,NULL),(67,'2018-03-02','2018-04-20','2018-04-06 21:50:17','2018-04-17 21:18:39','IQwjKJ','Ayudas en materia de Energías Renovables y Biocarburantes, para el ejercicio 2018.','http://www.gva.es/es/inicio/procedimientos?id_proc=764','http://www.dogv.gva.es/datos/2016/10/25/pdf/2016_8362.pdf','','GV','40%','Impulsar las actuaciones encaminadas a la explotación de los recursos energéticos renovables y fomentar el uso de los biocarburantes en la Comunitat Valenciana.','<p>Nos sirve para todas las ideas sobre energ&iacute;a que llevamos idea desarrollar, <a href=\"http://www.ivace.es/index.php?option=com_content&amp;view=article&amp;id=6683:programa-de-energias-renovables-y-biocarburantes-2018&amp;catid=407:ayudas-2018-ahorro-y-eficiencia-energetica-y-energias-renovables&amp;lang=es&amp;Itemid=100456\">detalles en web ivace.</a></p>\r\n<p>Muy interesante, ya que abarca todas las lineas: piscina, pellets,...</p>','','-',NULL,10,6,5,NULL),(68,'2018-04-04','2018-05-04','2018-04-09 20:09:51','2018-04-20 05:55:41','zIfFbE','Ayudas destinadas a la promoción de la economía sostenible en la Comunitat Valenciana 2018. Economía.','http://www.gva.es/es/inicio/procedimientos?id_proc=18212','http://www.dogv.gva.es/datos/2018/04/03/pdf/2018_3025.pdf','http://www.dogv.gva.es/datos/2017/02/06/pdf/2017_902.pdf','GV','','La concesión de subvenciones destinadas a contribuir a la promoción de la economía sostenible en la Comunitat Valenciana, a través de la financiación de actuaciones de fomento y difusión de la cultura y prácticas de las empresas sociales y de la Economía del Bien Común (EBC).','<p>1.- Actividades de formaci&oacute;n, fomento y difusi&oacute;n de la cultura y pr&aacute;cticas de la empresa social y de la EBC en la Comunitat Valenciana REALIZADAS POR ASOCIACIONES, FUNDACIONES Y OTRAS ENTIDADES Y ORGANIZACIONES SIN &Aacute;NIMO DE LUCRO que tengan entre sus fines la promoci&oacute;n y fomento de los principios vinculados a la empresa social y/o de la EBC, en cualquiera de las siguientes modalidades: a) Actividades de fomento de estudios de aspectos relacionados con la empresa social y con la EBC, como la realizaci&oacute;n de talleres, coloquios, charlas, congresos, encuentros, mesas redondas, simposios, jornadas, seminarios y otras actividades similares, que tengan como finalidad la divulgaci&oacute;n y el intercambio de conocimientos y mejores pr&aacute;cticas entre profesionales y expertos en esas materias. b) Actividades de difusi&oacute;n para mejorar la visibilidad de la empresa social y de la EBC y el impacto que tienen en la sociedad, entendi&eacute;ndose por tales aquellas cuyo objeto sea dar a conocer o divulgar entre la poblaci&oacute;n en general o a colectivos espec&iacute;ficos la cultura y pr&aacute;ctica de la empresa social y de la EBC, mediante campa&ntilde;as de informaci&oacute;n y difusi&oacute;n en medios de comunicaci&oacute;n social, edici&oacute;n de publicaciones y dem&aacute;s documentaci&oacute;n did&aacute;ctica, actividades de &iacute;ndole art&iacute;stica (exposiciones, ciclos de cine, m&uacute;sica, etc) y cualquier otra actividad que contribuya a esta finalidad. c) Actuaciones de innovaci&oacute;n social y emprendimiento social positivos que permitan promover y apoyar ideas que, de manera simult&aacute;nea, resuelvan las necesidades sociales, creen nuevas relaciones sociales y refuercen la creaci&oacute;n de valor econ&oacute;mico. d) Actividades de promoci&oacute;n del emprendimiento social en todos los niveles educativos. 2.- Actuaciones REALIZADAS POR PEQUE&Ntilde;AS Y MEDIANAS EMPRESAS (PYMES) para la implantaci&oacute;n de la cultura y pr&aacute;ctica de la empresa social y de la EBC, consistentes en la elaboraci&oacute;n e implantaci&oacute;n de una memoria de sostenibilidad que contribuya a medir, supervisar y gestionar el rendimiento de las empresas y su impacto en la sociedad en la triple vertiente social, econ&oacute;mica y medioambiental, permitiendo medir el &eacute;xito &eacute;tico de la organizaci&oacute;n y su contribuci&oacute;n al bien com&uacute;n, tales como el Balance del Bien Com&uacute;n, memoria de responsabilidad social, estado no financiero u otras herramientas similares. La memoria de sostenibilidad y su auditor&iacute;a social externa deber&aacute;n ajustarse a lo previsto en los apartados 2, 3 y 4 del art&iacute;culo 19 de la Orden 2/2017 y en los apartados 2 y 3 del resuelvo quinto de la Resoluci&oacute;n de convocatoria 2018. 3.- Actividades de los CENTROS, INSTITUTOS Y ENTES UNIVERSITARIOS dirigidas a financiar los gastos derivados de actividades de investigaci&oacute;n b&aacute;sica sobre la EBC, la empresa social y el emprendimiento e innovaci&oacute;n social, as&iacute; como destinados al impulso de la investigaci&oacute;n aplicada en esas materias, en cualquiera de las siguientes modalidades: a) Investigaci&oacute;n dirigida a profundizar en los conceptos y valores que rigen estos modelos. b) Aplicaci&oacute;n pr&aacute;ctica y desarrollo de las herramientas que llevan impl&iacute;citos estos modelos, como la metodolog&iacute;a para la medici&oacute;n de la contribuci&oacute;n de las empresas al bien com&uacute;n, elaboraci&oacute;n del Balance del Bien Com&uacute;n, y otras herramientas similares. c) Investigaciones y estudios sobre la contribuci&oacute;n real de las empresas sociales y de la EBC a los principales agregados macroecon&oacute;micos, as&iacute; como su valor a&ntilde;adido en comparaci&oacute;n con otros modelos empresariales, sus efectos sobre la resiliencia y sus relaciones con la innovaci&oacute;n social y el emprendimiento. d) Recopilaci&oacute;n de estad&iacute;sticas y construcci&oacute;n de indicadores que doten de mayor reconocimiento y visibilidad a las empresas sociales y al emprendimiento social, y permitan una mejor comprensi&oacute;n de sus modelos, profesionalidad y su papel en la sociedad. e) Formaci&oacute;n especializada en materia de emprendimiento e innovaci&oacute;n social y/o EBC.</p>','','-',NULL,4,6,5,NULL),(69,'2018-03-29','2018-04-19','2018-04-10 09:03:37','2018-04-20 16:34:22','H6vAsW','Subvenciones Ayuntamientos y EATIM para la elaboración y evaluación de Planes de Igualdad de Género','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=221','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00083.pdf','','DA','< 3.000 €','para coadyuvar a los gastos derivados de los proyectos de elaboración y evaluación de planes de igualdad de género a ejecutar desde el 1 de octubre de 2017 al 30 de septiembre de 2018.','<p>JC: 20-04-2018: Tras conversaci&oacute;n con MVicenta me entero de que ya tenemos plan de igualdad. Se aprob&oacute; en pleno el 3/2017, pero no se ha llevado a cabo ninguna acci&oacute;n. Me descargo documento y lo subo a drive</p>\r\n<p>&nbsp;</p>\r\n<p>JC: 17-4-2018: La semana anterior ya estuve hablando con las personas que conoc&iacute;a que me pod&iacute;an explicar un poco de lo que iba esto de los planes de igualdad. Me recomendaron que me pusiera en contacto con MC Formaci&oacute;n. As&iacute; lo hice, habl&eacute; con una chica que me dijo que me enviar&iacute;a una propuesta (que guardo en Drive). Ahora env&iacute;o correo a Thierry y que sea &eacute;l quien decida. Por mi parte me parece interesante solicitarlo porque parece que en un futuro pr&oacute;ximo, el tener el plan, ser&aacute; requisito imprescindible para acceder a subvenciones.</p>\r\n<p>&nbsp;--</p>\r\n<p>Ser&aacute;n subvencionables los proyectos que tengan como finalidad: 4.1.- La elaboraci&oacute;n de un plan de igualdad de g&eacute;nero, ya sea por vez primera o se trate de un segundo o posterior plan.</p>','https://drive.google.com/open?id=1Zaw_1a2vKEdF2-H_tJDmO32wkz6-4yIE','15/2016 EXP. 18',9,2,NULL,5,NULL),(70,'2017-12-14','2018-02-14','2018-04-10 12:33:38','2018-04-17 19:33:34','vwMMGp','Programa 1: Inversión en adecuación y mejora de los servicios y recursos turísticos','http://www.gva.es/es/inicio/procedimientos?id_proc=2688','','','GV','< 40.000 €','Inversión en adecuación y mejora de los servicios y recursos turísticos','<p>JC: 16-04-2018: a trav&eacute;s del whatsapp me pongo en contacto con Arques y me informa que la subvenci&oacute;n est&aacute; baremandose, pero que llevan mucho l&iacute;o y a&uacute;n tardar&aacute;n en resolver.</p>\r\n<p>JC: 10-04-2018: Haciendo una revisi&oacute;n de las subvenciones.... he llamado a Jordi para ver que puede decirnos de la subvenci&oacute;n. La doy de alta en esta herramienta. Se envi&oacute; el 14/02/2018</p>','https://drive.google.com/open?id=0B-6ZND28b8BsZ3FYTkN2eGpmOWc','3/2018 - EXP 9',NULL,4,16,5,NULL),(71,'2017-12-07','2018-01-31','2018-04-10 17:59:37','2018-04-16 18:32:36','ICPmM8','Convocatoria de subvenciones destinadas a la mejora, ampliación o reparación de instalaciones deportivas en municipios de la comunidad valenciana','http://www.presidencia.gva.es/web/administracion-local/noticias?p_p_id=101_INSTANCE_x1NrD8krzxri&p_p_lifecycle=0&p_p_col_id=column-2&p_p_col_pos=2&p_p_col_count=3&_101_INSTANCE_x1NrD8krzxri_struts_action=%2Fasset_publisher%2Fview_content&_101_INSTANCE_x1NrD8krzxri_assetEntryId=165129810&_101_INSTANCE_x1NrD8krzxri_type=content&_101_INSTANCE_x1NrD8krzxri_groupId=80292207&_101_INSTANCE_x1NrD8krzxri_urlTitle=convocatoria-de-subvenciones-destinadas-a-la-mejora-ampliacion-o-reparacion-de-instalaciones-deportivas-en-municipios-de-la-comunidad-valenciana-','','','GV','100.000 €','- Tipo A: mejora, ampliación o reparación de instalaciones deportivas en municipios de la Comunidad Valenciana hasta 5000 habitantes.','<p>JC: 16/04/2018: llamo a Conchi, me dice que finalmente no es ella quien lleva eso. Me dice que lo llevan en Valencia y me da el contacto de Jose Miguel Sanchez. Hablo con &eacute;l, <strong>me confirma que lleg&oacute;</strong> nuestro expediente, que <strong>tiene buen aspecto</strong> y que seguramente nos lo den.</p>\r\n<p>JC: 10-04-2018: se env&iacute;a el 20 de enero de 2018, a las 9:12 horas. llamo hoy para interesarme (hice alguna llamada en d&iacute;as anteriores) y me dicen que no tienen constancia de nuestra petici&oacute;n. Lo hablo con @tierry y me dice el expediente y que existe la minuta del env&iacute;o. Llamar&eacute; Concepci&oacute;n Lazaro que es con quien habl&eacute;.&nbsp;<strong>asdas</strong>&nbsp;<em>dasas a</em></p>\r\n<p>&nbsp;</p>','https://drive.google.com/drive/folders/0B-6ZND28b8BsWExBMXNuTlVMaDg?usp=sharing','2/2017 CULTURA Y DEPORTES EXP. 37',NULL,3,13,5,NULL),(72,'2018-04-11','2018-05-24','2018-04-12 05:44:52','2018-04-12 05:44:52','cS7kxt','Actuaciones para la conservación y mejora de los Parajes Naturales','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=230','','','DA','','Concesión de subvenciones para los gastos derivados de la ejecución por los beneficiarios de las actuaciones de conservación y mejora de los Parajes Naturales Municipales.','JC: 12-04-2018: Pues esta subvención salió hace dos años. por lo que entiendo que es bianual. Es solo para municipios que tengan declarado un paraje natural. en la provincia de Alicante no debe haber más de una docena. El más cercano el arcs de Castells. \r\nYa lo hablé con Sendra, que ellos nos darían asistencia técnica para declarar alguna zona de Tárbena como Paraje Natural Municipal, pero es algo a lo que todavía no he llegado. Puede que después de las prácticas que haga en el ayto saquemos algo en claro. Ya hay una tesis universitaria que abre las puertas a esta figura de protección.','','3/2018 - EXP 24',8,4,NULL,5,NULL),(73,'2018-04-13','2018-05-28','2018-04-13 05:33:59','2018-04-13 05:33:59','mxxznN','TECG- Ayudas a actuaciones que promuevan la integración de la mujer en el ámbito rural.','http://www.gva.es/es/inicio/procedimientos?id_proc=1376','','','GV','','Se concederán ayudas para las actividades que se indican en el apartado \"Información Complementaria\", que promuevan la integración y la igualdad de oportunidades de la mujer en el ámbito rural.','Solo para organizaciones profesionales agrarias que integren organizaciones de mujeres, u organizaciones de mujeres con personalidad jurídica propia.\r\n\r\nACTIVIDADES SUBVENCIONABLES\r\n- Actividades de participación y fomento del asociacionismo. Se consideran como tales la celebración de conferencias y charlas, la realización de jornadas y congresos y la concurrencia a exposiciones y ferias, actividades realizadas por la propia organización en el ámbito de la Comunidad Valenciana.\r\n- Asistencia a jornadas o actos por representantes de las organizaciones solicitantes, cuando éstos se celebren fuera de la Comunidad Valenciana.\r\nEn la celebración de conferencias y charlas, así como la realización de jornadas y congresos, y la concurrencia a exposiciones y ferias, la subvención podrá ser hasta un máximo del 100% por lo que respecta al pago de los gastos correspondientes a ponentes externos a la organización, y hasta un máximo del 70% para el resto de las actividades, sin que pueda superar en el cómputo de subvención concedida por las actividades propuestas de este concepto el 80% de los gastos.\r\n- Viajes de estudio e intercambio en otras zonas geográficas (ámbito español o superior).\r\nPor la realización de viajes de estudio e intercambio en otras zonas geográficas la subvención será hasta un máximo del 70% del coste.\r\n- Actividades de promoción. Realización de cursos, talleres de trabajo y edición de material de divulgación y su distribución.\r\nLa subvención será hasta de un máximo del 80% del coste cuando se trate de la edición de material divulgativo y su distribución, y hasta un máximo del 70% por cualquier otro tipo de actividad dentro de este concepto.\r\n- Actividades complementarias. Aquellas relacionadas con el fomento del turismo rural, medio ambiente, la artesanía, o la promoción de los productos agroalimentarios propios.\r\nLa subvención será hasta de un máximo del 50% del coste.','','-',NULL,2,3,5,NULL),(74,'2018-04-10','2018-04-24','2018-04-13 05:41:50','2018-04-13 05:41:50','WglPXf','Ayudas a asociaciones juveniles y entidades prestadoras de servicios a la juventud con ámbito de actuación en la Comunitat Valenciana para el año 2018 (IVAJ)','http://www.gva.es/es/inicio/procedimientos?id_proc=221','','','GV','','Ayudas a asociaciones juveniles y entidades prestadoras de servicios a la juventud con ámbito de actuación en la Comunitat Valenciana para el año 2018 (IVAJ)','Requisitos\r\n\r\nPodrán obtener la condición de beneficiarios de estas ayudas las asociaciones juveniles y las entidades prestadoras de servicios a la juventud que cumplan con los siguientes requisitos:\r\n- Tener una implantación territorial en, al menos, quince localidades de dos provincias de la Comunitat Valenciana.\r\n- Estar inscritas en el Censo de Asociaciones Juveniles y Entidades Prestadoras de Servicios a la Juventud de la Comunitat Valenciana.\r\nDicha inscripción deberá haberse producido con anterioridad a la fecha de finalización del plazo de presentación de solicitudes.','','-',NULL,2,17,5,NULL),(75,'2018-04-13','2018-05-28','2018-04-13 05:52:42','2018-04-13 05:52:42','vltGKd','TECG - Solicitud de ayudas para las comunidades de regantes y otras entidades de riego en relación con el fomento de la utilización racional del agua en aprovechamientos hidráulicos y regadíos.','http://www.gva.es/es/inicio/procedimientos?id_proc=562','','','GV','50 %','Consolidar y modernizar los regadíos de la Comunitat Valenciana, al tiempo que se promueven prácticas de cultivo en común.\r\n\r\nSerán obras subvencionables todas aquellas que contribuyan a la optimización del uso y gestión de los recursos hídricos, mediante la implantación del riego localizado, incremento de la capacidad de embalse, ahorro de agua, aumento de la eficiencia en su utilización y mejora de la rentabilidad de las explotaciones agrarias.','Habría que despestar a las asociaciones de regantes, que creo que hay hasta tres en el pueblo.','','-',NULL,10,3,5,NULL),(76,'2018-04-12','2018-05-25','2018-04-13 19:28:25','2018-04-13 19:28:25','uJXLrs','TECG - Ayudas a las asociaciones de protección y defensa de los animales.','http://www.gva.es/es/inicio/procedimientos;jsessionid=pRRChRGN254VtvmhGRLtsGfNpp3pJxy2kVq3w5vzh5RTRWs2fhPB!1094503321!1523647597692?id_proc=861','','','DA','7.200 €','Asociaciones de protección y defensa de los animales sin ánimo de lucro, legalmente constituidas e inscritas en el Registro de Asociaciones de la Conselleria de Justicia, Administración Pública, Reformas Democráticas y Libertades Públicas, y que tengan por principal finalidad la defensa y protección de los animales y desarrollen algunas de las actividades relacionadas en el apartado de \'Información Complementaria\', en el ámbito territorial de la Comunitat Valenciana.','Las ayudas por beneficiario serán del 60% del coste global presupuestado, para el conjunto de las actividades para las que soliciten ayudas de gastos de funcionamiento, con una cuantía máxima por beneficiario de 7.200 euros, y del 80% del coste global presupuestado para las inversiones referentes a construcción y adecuación de instalaciones con una cuantía máxima de la ayuda por beneficiario de 12.000 euros.','','-',NULL,2,NULL,5,NULL),(77,'2018-04-12','2018-05-11','2018-04-13 19:31:57','2018-04-13 19:31:57','C56v6w','TECG - Subvenciones destinadas a programas y proyectos educativos y de formación y divulgación para estrategias de dinamización agroecológicas en el ámbito de la Comunitat Valenciana (modalidad A y modalidad B)','http://www.gva.es/es/inicio/procedimientos?id_proc=18691','','','GV','< 60.000 €','Podrán solicitar las subvenciones objeto de regulación, aquellas Entidades Asociativas Agrarias, Asociaciones, Fundaciones y empresas del sector agroalimentario que cumplan y acrediten los requisitos para obtener la condición de beneficiario según lo establecido en la base segunda y tercera de la de la Orden 32/2017, de 29 de diciembre.','JC: Podría funcionar para IMO o TEO.\r\n\r\nLos objetivos específicos a los que habrán de adecuarse los proyectos y programas de la modalidad A son:\r\n- Proyecto que promuevan los procesos educativos y actividades pedagógicas para trabajar los objetivos de un consumo ecológico y responsable, en y desde las instituciones y centros educativos, públicos o sostenidos con fondos públicos,\r\n- Proyecto que promuevan en el alumnado y en el conjunto de la comunidad educativa conocimientos, valores y actitudes capaces de generar una cultura del consumo ecológico y responsable comprometida con la lucha contra el cambio climático,\r\n- Proyecto que promuevan la transición hacia un nuevo modelo agroalimentario incluyente, equitativo y sostenible.\r\n\r\nLos objetivos específicos a los que habrán de adecuarse los proyectos y programas de la modalidad B son:\r\n- Intervenciones orientadas a la sensibilización de la sociedad en su conjunto, o determinados sectores de la misma en particular, que promuevan y aumenten la concienciación y el compromiso ciudadano solidario con la consecución del consumo ecológico y responsable comprometido con la lucha contra el cambio climático, así como con la transición hacia un nuevo modelo agroalimentario incluyente, equitativo y sostenible.','','-',NULL,4,3,5,NULL),(78,'2017-02-01','2017-02-20','2018-04-13 19:47:01','2018-04-14 13:58:54','rpvdTy','Gasto corriente agricultura y sostenimiento medio rural','','','','DA','< 2.500','Limpieza y conservación mediante desbroce y roturación de terrenos de titularidad municipal destinados a cultivo. Desbroce o limpieza de márgenes de accesos a zonas rurales o agrícolas de titularidad municipal o a título de dueño. Reparación simple, conservación o mantenimiento de acequias, márgenes, muretes, construcciones agrícolas tradicionales, conducciones de regadío en\r\ncanal abierto y redes de drenaje y avenamiento de titularidad municipal o a título de dueño.\r\nActuaciones formativas en materia de: agricultura ecológica, producción integrada, comercialización de productos agrícolas, prácticas culturales (plantación, riego, poda, injertos, labrado, post-cosecha, tratamientos fitosanitarios) y obtención del camé oficial de manipulador de plaguicidas de uso fitosanitario de nivel básico, conforme a las especificaciones del Decreto 3012015 de 06 de marzo por el que se desarrollan determinados aspectos administrativos relativos a los productos fitosanitarios en la Comunitat Valenciana.','JC: 13-04-2018: pensar para la subvención de este año en el corazón verde y el carnet fitosanitario.\r\n\r\nDesbroce y limpieza de márgenes del Camí Picassaries y actuaciones formativas \" Curso de Introducción a la agricultura ecológica y tradicional\" y \"curso de prácticas culturales; plantación, riego, poda, injertos, labrado, postcosecha, tratamientos\"  ( 4987,76 € ) (  750 € por curso y 1000 € por el resto ) .\r\n\r\nel plazo para presentar la justificación y abono es el 31 de octubre.\r\n\r\nrealmente el desbroce ahora mismo no es prioritario. tengo que hablar con Montllor para ver como hacemos lo del curso. Creo que lo intenresante sería ampliar el de agricultura ecológica, pero para eso necesitaríamos un bancal con agua lo suficientemente grande. Tengo que llamarle para más detalles.','https://drive.google.com/open?id=0B-6ZND28b8BsNlZzNFFNd2hBTEE','-',13,7,NULL,5,NULL),(79,'2018-04-11','2018-04-25','2018-04-13 20:19:30','2018-04-13 20:19:30','XWcu5R','Subvenciones para el fomento del valenciano para las instituciones, entidades y asociaciones sin finalidad lucrativa y para las personas jurídicas públicas y privadas que realicen proyectos singulares de fomento del multilingüismo en el ámbito social.','http://www.gva.es/es/inicio/procedimientos?id_proc=276','','','GV','','Para Amics des Museu o el CERM\r\nConvocar, para 2018, las subvenciones para el fomento del valenciano para asociaciones cívicas sin finalidad lucrativa, sindicatos, asociaciones profesionales, universidades, redes universitarias y otras entidades sin ánimo de lucro, entidades del exterior de la Comunitat Valenciana y para las personas jurídicas, públicas y privadas, que realicen proyectos singulares de fomento del multilingüismo en el ámbito social.','El importe en concepto de ayudas para esta modalidad será de 980.000 euros. El importe será con cargo a la línea S0091000, «Ayudas al fomento del valenciano y a proyectos singulares de fomento del multilingüismo en el ámbito social», del presupuesto de 2018 de la Generalitat Valenciana.','','-',NULL,4,13,5,NULL),(80,'2018-04-11','2018-07-10','2018-04-13 20:29:30','2018-04-13 20:29:30','89fqan','TECE - Solicitud de subvenciones para la mejora de las condiciones del interior de las viviendas, en el marco del Plan de Reforma Interior de Vivienda. Plan RENHATA.','http://www.gva.es/es/inicio/procedimientos?id_proc=18507','','','GV','> 2.000 €','Cualquier persona física, propietaria, usufructuaria o arrendataria de una vivienda situada en la Comunitat Valenciana. \r\n\r\n1. Reforma de los cuartos húmedos (cocinas, baños, etc...), con el fin de adecuarlos a las condiciones actuales de habitabilidad, incluyendo, si es necesario, la adaptación de las instalaciones a la normativa vigente.\r\n\r\n2. Reforma de la vivienda para adaptarla a personas con diversidad funcional y movilidad reducida.','1. El edificio en el momento de la solicitud debe tener una antigüedad superior a 20 años. No será necesario cumplir esta condición en el caso de actuaciones de adaptación de la vivienda para personas con diversidad funcional con un grado de discapacidad superior al 50%.\r\n\r\n2. Que la vivienda se destine a residencia habitual y permanente de su propietario, inquilino o usufructuario. Lo que se considerará acreditado al estar empadronado con anterioridad a la solicitud de las ayudas.\r\n\r\nLas obras subvencionables podrán recibir las siguientes subvenciones:\r\n\r\na) Una subvención básica, para todos los solicitantes que cumplan los requisitos para recibir las ayudas y aporten toda la documentación requerida, del 5 por 100 del presupuesto protegible de las obras, con un máximo de 600 euros.\r\n\r\nb) Una subvención adicional, en función de los puntos obtenidos en el baremación de las solicitudes, con los porcentajes y las cuantías máximas siguientes:\r\n\r\n- Puntuación: entre 1 y 5 puntos; porcentaje sobre presupuesto protegido: 25%; cuantía máxima subvención adicional: 3.000 euros.\r\n- Puntuación: entre 6 y 10 puntos; porcentaje sobre presupuesto protegido: 30%; cuantía máxima subvención adicional: 3.600 euros.\r\n- Puntuación: entre 11 y 15 puntos; porcentaje sobre presupuesto protegido: 35%; cuantía máxima subvención adicional: 4.200 euros.','','-',NULL,4,18,5,NULL),(81,'2018-04-09','2018-04-30','2018-04-13 21:20:32','2018-04-27 07:05:07','y1R5L3','Subvenciones para inversiones en restauración de zonas degradadas por el vertido incontrolado de residuos','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=229','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00087.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00081.pdf','DA','< 20.000 €','A efectos de esta convocatoria, se entiende como restauración de zonas degradadas por el vertido incontrolado de residuos la adecuación de aquellas zonas de acceso libre en las que se haya producido vertido de residuos sin autorización, a fin de retirar los residuos vertidos y acondicionar la zona para su integración paisajística y erradicación del foco de vertido','<p>JC: 25-04-2018: Hablo con Maril&oacute;, que me remite a Fernando, para que me haga un documento de cesi&oacute;n. Viene a firmarlo Jos&eacute; Molines. Lo dejo en la mesa de @Thierry para que lo firme. El viernes que lo firme @Maril&oacute; y lanzamo la subvenci&oacute;n</p>\r\n<p>JC: 17-04-2018: Leo las bases y es para vertidos:</p>\r\n<p>17 RESIDUOS DE LA CONSTRUCCION Y DEMOLICION (INCLUIDA LA TIERRA EXCAVADA DE ZONAS CONTAMINADAS)</p>\r\n<p>20 RESIDUOS MUNICIPALES (RESIDUOS DOMESTICOS Y RESIDUOS ASIMILABLES PROCEDENTES DE LOS COMERCIOS, INDUSTRIAS E INSTITUCIONES), INCLUIDAS LAS FRACCIONES RECOGIDAS SELECTIVAMENTE</p>\r\n<p>Y siguiendo leyendo se podr&iacute;a decir que tenemos todo lo necesario. Lo que si que tendr&aacute; que ver Josemi y Fernando es:</p>\r\n<p>-Acreditativo de la clasificaci&oacute;n y calificaci&oacute;n urban&iacute;stica de la parcela y/o parcelas afectadas por la actuaci&oacute;n.<br />- Acreditativo de la titularidad y disponibilidad de los terrenos y su puesta a disposici&oacute;n de esta Excma. Diputaci&oacute;n Provincial para la ejecuci&oacute;n de la actuaci&oacute;n.<br />- Acreditativo de estar en posesi&oacute;n de las autorizaciones o concesiones administrativas y de particulares que fueran precisas para permitir la iniciaci&oacute;n de la obra, si bien, en el caso de que no sean necesarias, deber&aacute; certificarse en dicho<br />t&eacute;rmino.<br />- Acreditativo de que las actuaciones previstas se adaptan al planeamiento urban&iacute;stico de dicha zona.</p>\r\n<p>----</p>\r\n<p>Las actuaciones subvencionadas ser&aacute;n ejecutadas por la Excma. Diputaci&oacute;n Provincial de Alicante, que se encargar&aacute; tambi&eacute;n de la redacci&oacute;n de los proyectos simplificados o memorias valoradas, de acuerdo con lo establecido en la normativa de contrataci&oacute;n de las Administraciones P&uacute;blicas, junto con la documentaci&oacute;n complementaria que los Servicios T&eacute;cnicos estimen realizar para la adecuada tramitaci&oacute;n del expediente, as&iacute; como de la coordinaci&oacute;n de seguridad y salud de la obra. Por tanto, la Excma. Diputaci&oacute;n Provincial de Alicante subvencionara en el 100% las actuaciones. Asimismo, la Excma. Diputaci&oacute;n se encargar&aacute; de la contrataci&oacute;n y direcci&oacute;n de las obras necesarias.</p>','https://drive.google.com/drive/folders/0B-6ZND28b8BsNjNJQkFpS3EyLVk?usp=sharing','3/2018 EXP. 27',15,4,NULL,5,NULL),(82,'2018-04-09','2018-04-30','2018-04-13 21:24:48','2018-04-20 12:17:12','fWz9YY','Asistencia en la gestión del inventario de bienes y derechos de las Entidades Locales','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=159','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00086.pdf','http://sede.diputacionalicante.es/documentos/emeri/ConvocatoriasImpresos/00080.pdf','DA','','La implantación de un sistema de gestión patrimonial e instalación del programa de gestión del patrimonio vinculado a la contabilidad','<p>JC: 13-04-2018: preguntar a Fernando si lo necesita o lo ve interesante</p>','','-',14,4,NULL,5,NULL),(83,'2018-04-17','2018-05-30','2018-04-17 09:48:23','2018-04-17 09:48:23','XxVsXE','Convocatoria de subvenciones para el ejercicio 2018 a entidades privadas sin ánimo de lucro para la realización de proyectos dirigidos a la integración social de personas inmigrantes.','http://www.gva.es/es/inicio/procedimientos?id_proc=2962','','','GV','','Las ayudas se otorgarán en concepto de subvención para la financiación de los gastos corrientes derivados de la realización de proyectos de integración social de personas inmigrantes que se desarrollen en el ámbito territorial de la Comunitat Valenciana en el ejercicio 2018, que se enmarquen en alguno de los siguientes programas:\r\nA.1. Acogida integral, incluyendo alojamiento y manutención.\r\nA.2. Primera acogida y acompañamiento, inserción sociolaboral, mediación intercultural, promoción de la interculturalidad y escuelas de acogida.\r\nA.3. Intervención social con población inmigrante a través de un sistema de trabajo en red.','<p>Entidades privadas sin &aacute;nimo de lucro. Familias Alternativas?</p>','','-',NULL,4,7,5,NULL),(84,'2018-04-17','2018-05-09','2018-04-17 09:50:39','2018-04-17 09:50:39','HnrlmV','TECG - Solicitud de ayudas a las asociaciones de defensa medioambiental con actividad en la Comunitat Valenciana para la difusión de las buenas prácticas en el uso del agua.','http://www.gva.es/es/inicio/procedimientos?id_proc=18420','','','GV','< 10.000 €','Difundir los buenos usos del agua en la Comunitat Valenciana.\r\nAsociaciones con actividad en la Comunitat Valenciana, que incluyan en sus estatutos finalidades y/o actividades de defensa medioambiental','<p>Para asociaci&oacute;n medioambiental o de j&oacute;venes</p>','','-',NULL,4,3,5,NULL),(85,'2018-04-19','2018-05-21','2018-04-19 11:04:01','2018-04-20 05:53:39','PPbXxQ','TECG - Ayudas a la distribución de frutas, hortalizas y leche al alumnado de centros escolares en la Comunitat Valenciana.','http://www.gva.es/es/inicio/procedimientos?id_proc=14922','','','GV','','Fomentar el consumo de frutas y hortalizas, frutas y hortalizas transformadas y productos del plátano, y leche y productos lácteos en los niños de edades tempranas, así como mejorar sus hábitos de consumo hacia el consumo de productos más saludables y, al mismo tiempo, concienciar a los menores de la importancia de consumir productos locales y producidos mediante fórmulas medioambientalmente sostenibles y respetuosas con el medio ambiente.','','','-',NULL,4,3,5,NULL),(86,'2018-04-19','2018-04-10','2018-04-20 12:14:31','2018-04-20 12:14:31','ApynmW','Subvenciones a ayuntamientos y E.A.T.I.M. para actividades en materia de prevención de conductas adictivas','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=232','','','DA','','Otros años han sido 1500 €','<p>JC: 20-04-2018 : El a&ntilde;o pasado se pidi&oacute; curso de pintura con Toni Ferri, se solicitaron 1500 &euro; y se termin&oacute; cobrando 819,53 El a&ntilde;o anterior se pidi&oacute; Cer&aacute;mica.&nbsp;</p>\r\n<p>Este a&ntilde;o se pedir&aacute; <strong>Cer&aacute;mica para los ni&ntilde;os, pintura para los adultos</strong></p>\r\n<p>APROBADO 819,53 &euro; - USO ADECUADO DE LAS TECNOLOGIAS Y PREVENCION DEL JUEGO DE APUESTAS . Ver que se hizo otros a&ntilde;os. otros a&ntilde;os la cer&aacute;mica. Vamos a pedir uno nuevo de pintura.</p>\r\n<p>Se pide uso adecuado de las tecnologias= curso pintura a Ferri. Solicitado. 1500&euro;</p>','','-',9,4,NULL,5,NULL),(87,'2018-04-16','2018-05-05','2018-04-20 16:15:21','2018-04-23 16:14:39','TZptIs','Fomento y desarrollo - Línea 1.- Ferias y otros eventos comerciales.','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=103','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00090.pdf','','DA','< 6000 €','Podrán solicitar las subvenciones objeto de la presente línea los Ayuntamientos y Entidades locales menores de la provincia de Alicante con población inferior a 50.000 habitantes.','<p>JC: 23-04-2018: el a&ntilde;o pasado se solicit&oacute;: Telas, actuaci&oacute;n. Fireta. Colla de dol&ccedil;ainers. y mas cosas. reuni&oacute;n 15 abril. 27/06/2017 llega resoluci&oacute;n. 5.571,00 - 92,85%</p>\r\n<p>Se encarga Mar&iacute;a Vicenta en petici&oacute;n continuista.</p>\r\n<p>Son subvencionables dentro de esta l&iacute;nea, las actuaciones de gasto corriente para la realizaci&oacute;n de ferias y otros eventos comerciales que se especifican a continuaci&oacute;n:<br />- Asistencia t&eacute;cnica para la organizaci&oacute;n y montaje de la totalidad de la feria o evento comercial. Cuando se contrate la totalidad de la feria con un &uacute;nico proveedor.<br />Cuando la feria se organice desde la propia entidad:<br />- Alquiler de stands y/o carpas.<br />- Publicidad y promoci&oacute;n de la feria o evento comercial.<br />- Alquiler de iluminaci&oacute;n de la feria o evento comercial.<br />- Sonido y megafon&iacute;a de la feria o evento comercial.<br />- Realizaci&oacute;n de degustaciones de productos aut&oacute;ctonos locales y cuya cuant&iacute;a no podr&aacute; superar el 10% del resupuesto total de la feria o evento comercial.<br />- Actividades complementarias como por ejemplo representaciones art&iacute;sticas y musicales, ludotecas e hinchables, que se desarrollen dentro de la feria o evento comercial, como parte integrante del evento principal y cuya cuant&iacute;a<br />no podr&aacute; superar el 30% del presupuesto total del mismo.<br />- Decoraci&oacute;n.<br />No ser&aacute;n subvencionables<br />- Gastos de personal al servicio de las entidades peticionarias,<br />- Gastos de material de oficina, ni los gastos generales de funcionamiento de la entidad.<br />- Alquiler de mesas y sillas.<br />- Alquiler de WC<br />- Servicios de vigilancia.<br />- Servicios de limpieza.<br />- Comidas y bebidas que no entren en la categor&iacute;a de productos aut&oacute;ctonos locales (productos t&iacute;picos de la zona)</p>','','-',16,4,NULL,5,NULL),(88,'2018-04-16','2018-05-14','2018-04-23 16:17:37','2018-04-26 07:53:05','P55SQB','Fomento y desarrollo - Línea 2.- Plan de modernización de mercados municipales','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=103','','','DA','','','','','-',16,4,NULL,5,NULL),(89,'2018-04-16','2018-05-15','2018-04-23 16:36:09','2018-04-23 16:36:09','F8fxKa','Fomento y desarrollo - Línea 3.- Promoción económica','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=103','','','DA','< 4000','Gastos de organización de concursos y premios para proyectos empresariales 3\r\nElaboración de materiales para el asesoramiento empresarial, orientación laboral o búsqueda de empleo que sirvan de apoyo para los agentes de empleo y desarrollo local en el servicio de sus funciones 1\r\nGastos de organización de cursos para fomento del empleo y emprendedurismo y para la consolidación de la pequeña y mediana empresa con un límite máximo de 1.000 euros por curso. 2\r\nGastos de organización de jornadas, foros y congresos para el empleo, el desarrollo local y el empresarial. 4\r\nRealización de actuaciones de dinamización y diversificación de la economía local 5','<p>JC: 23-04-2018: El a&ntilde;o pasado:&nbsp; World Caf&eacute; y pagos premios mujeres emprendedoras. hay que definir las fechas de los world caf&eacute;s. &ldquo;Dinamizacion y fomento de la participaci&oacute;n en el sector agricola y empresaria &ldquo;l</p>\r\n<p>Env&iacute;o correo a los empresarios y voy rumiando ideas.</p>','','-',16,4,NULL,5,NULL),(90,'2018-04-16','2018-05-15','2018-04-23 16:49:43','2018-04-23 16:49:43','XECdbA','Fomento de la agricultura y sostenimiento del medio rural. Línea 4','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=103','','','DA','> 2500','Actuaciones formativas en materia de: agricultura ecológica, producción integrada, comercialización de productos agrícolas, prácticas culturales y obtención del carné oficial de manipulador de plaguicidas de uso fitosanitario de nivel básico 1\r\nLimpieza y conservación mediante desbroce y roturación de terrenos de titularidad municipal destinados a cultivo 2\r\nDesbroce o limpieza de márgenes de accesos a zonas rurales o agrícolas de titularidad municipal 3\r\nReparación simple, conservación o mantenimiento de acequias, márgenes, muretes, construcciones agrícolas tradicionales, conducciones de regadío en canal abierto y redes de drenaje y avenamiento de titularidad municipal 5','<p>JC: 23-04-2018: El a&ntilde;o pasado se hizo el desbroce camino font taronger y el curso de huerto ecol&oacute;gico.</p>','','-',16,4,NULL,5,NULL),(91,'2018-04-16','2018-05-15','2018-04-23 16:59:51','2018-04-23 16:59:51','ElbxuV','Huertos urbanos municipales. Línea 5','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=103','','','DA','< 1500','Actividades formativas a los usuarios de huertos urbanos municipales en materia de agricultura (agricultura ecológica, prácticas culturales:\r\nplantación, riego, poda, injertos, labrado, tratamientos fitosanitarios), así como las actuaciones formativas para la obtención del carné oficial de manipulador de plaguicidas de uso fitosanitario de nivel básico, conforme a las especificaciones del Decreto 30/2015 de 06 de marzo por el que se desarrollan determinados aspectos dministrativos\r\nrelativos a los productos fitosanitarios en la Comunitat Valenciana. Se establece un límite de 750 € por curso con un máximo de dos.\r\n- Trabajos de preparación y roturación de terreno en huertos urbanos municipales.\r\n- Señalética horizontal para la identificación del huerto, división de parcelas del huerto y marcado de caminales.\r\n- Reparación simple y adecuación del sistema de riego del huerto urbano.\r\n- Reparación simple y conservación de caminales del huerto urbano.\r\n- Reparación simple y conservación de almacenes y casetas ubicadas en huertos urbanos.\r\n- Trabajos de preparación y roturación de terrenos en huertos escolares municipales.\r\nNo serán subvencionables:\r\n- Gastos de personal al servicio de las entidades peticionarias.\r\n- Gastos de material de oficina y los gastos generales de funcionamiento de la entidad.','','','-',16,2,NULL,5,NULL),(92,'2018-04-24','2018-05-23','2018-04-24 10:40:15','2018-04-27 06:52:50','1q2Nx4','Ayudas para la digitalización y la restauración de la documentación histórica y la mejora de las instalaciones de los archivos municipales de la Comunitat Valenciana.','http://www.gva.es/es/inicio/procedimientos?id_proc=16631','','','GV','> 600 50%','Contribuir a la financiación de los gastos derivados de la digitalización y de la restauración de documentos existentes en el archivo municipal anteriores al año 1940 y que se encuentren en mal estado, así como los gastos derivados de la compra o adquisición de equipamiento para la correcta conservación y utilización de los fondos documentales exisitentes en los archivos municipales.\r\n\r\nEl tipo de equipamiento será de uso exclusivo para el archivo y consistirá exclusivamente en estanterías metálicas de ángulo ranurado, armarios compactos móviles sobre raíles, planeros horizontales, deshumidificadores y termohigrómetros.\r\n\r\nQueda totalmente excluido de esta convocatoria el mobiliario de oficina.','<p>JC: 27-04-2018: Le pido a Agnieszka que profundice en la subvenci&oacute;n.</p>\r\n<p>JC: 24-04-2018: El a&ntilde;o pasado ya se mir&oacute; el tema de mejorar las instalaciones con la adquisici&oacute;n de unas estanterias, pero era un poco caro. Nos encontramos en el mismo caso.&nbsp;<br />Hecho un vistazo al archivo y bueno, lo de las estanter&iacute;as hay que tomarselo con calma. lo que si que veo que ser&iacute;a interesante ser&iacute;an un <strong><a href=\"https://es.wikipedia.org/wiki/Higr%C3%B3metro\">higr&oacute;metro</a></strong>, y renovar alg&uacute;n <strong>deshumificador</strong>.</p>\r\n<p>habr&aacute; que comprarlos y&nbsp; enviar la subvenci&oacute;n. Menos de 20 d&iacute;as.</p>\r\n<p>- La aportaci&oacute;n de la Conselleria de Educaci&oacute;n, Investigaci&oacute;n, Cultura y Deporte ser&aacute; como m&aacute;ximo del cincuenta por ciento (50%) del coste de la inversi&oacute;n que se realice <strong>entre el 25 de enero de 2017 y la fecha de finalizaci&oacute;n de presentaci&oacute;n de solicitudes</strong>, ambos inclusive. Los beneficiarios deber&aacute;n aportar, con cargo a su presupuesto, la parte no financiada por la Generalitat.</p>','https://drive.google.com/open?id=0B-6ZND28b8BsTnNPdk0tcmN6dTQ','-',NULL,4,13,5,NULL),(93,'2018-04-24','2018-05-23','2018-04-24 12:33:46','2018-04-25 20:32:58','fCAUSw','Construcción e Instalación de centros de Compostaje Comunitario.','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=234','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00095.pdf','','DA','< 10000 €','Ayudas para los gastos derivados de la ejecución por la Diputación Provincial de Alicante de las inversiones cuyo fin sea la instalación de un centro de compostaje comunitario.','<p>JC: 24-04-2018: hay que leer bien las bases, pero podr&iacute;a ser un segundo paso hacia la compostera municipal. Teniendo en cuenta que el hogar provincial dan de comer a unas 400 personas y usan una de estas composteras, podr&iacute;amos dar covertura a al menos la mitad del pueblo. Hay que buscar una ubicaci&oacute;n que nos venga bien. quiz&aacute;s el tema del camino viejo, encima del barraca.&nbsp;</p>\r\n<p>- La adecuaci&oacute;n del espacio donde se instalar&aacute; el centro de compostaje. Queda incluida la preparaci&oacute;n del terreno, la colocaci&oacute;n&nbsp; de un suelo de celos&iacute;a de hormig&oacute;n, la instalaci&oacute;n de una estructura para poder colocar un vallado perimetral y una cubierta, as&iacute; como una puerta con control de acceso.<br />- Carteler&iacute;a informativa sobre el proceso de compostaje.<br />- Cajones est&aacute;ticos de 1m3 colocados de manera que las paredes laterales internas de los cajones sean compartidas.<br />- Cajones para el almacenamiento de material estructurante.<br />-Contenedores con tapa de color marr&oacute;n para el almacenamiento debiorresiduos.<br />-Herramientas y utensilios para llevar a cabo las tareas de compostaje.</p>','https://drive.google.com/open?id=1OJpgsJEsbhGx0mIpmuKXy7DLxIr-89s6','3/2018 EXP. 31',15,4,NULL,5,NULL),(94,'2018-04-25','2018-05-15','2018-04-25 06:27:31','2018-04-25 06:27:31','MpMiTK','TECG - Ayudas para mejorar las condiciones de producción y comercialización de miel en la Comunidad Valenciana.','http://www.gva.es/es/inicio/procedimientos?id_proc=1209','','','GV','','Se convocan ayudas dirigidas a los titulares de explotaciones apícolas de la Comunitat Valenciana para que realicen inversiones y actuaciones con objeto de mejorar las condiciones de producción y comercialización de la miel para la vigente campaña FEAGA','','','-',NULL,4,3,5,NULL),(95,'2018-04-23','2018-05-14','2018-04-25 20:11:09','2018-04-25 20:22:42','T3CV7s','Obras de mejora de masas forestales (montes) de propiedad municipal','http://sede.diputacionalicante.es/detalle-catalogo-servicios/?id=233','http://sede.diputacionalicante.es/documentos/emeri/Convocatorias/00094.pdf','','DA','40.000','Concesión de subvenciones destinadas a la ejecución de obras de mejora de masas forestales (montes) de propiedad municipal en la provincia de Alicante, como pueden ser los siguientes: montes arbolados fosilizados, debilitados sin apenas crecimiento y con gran peligro de incendio; encinares degradados sin verdaderos árboles; montes sometidos a fuertes procesos erosivos; montes afectados por daños abióticos y cualquier otro tipo estado del monte que justifique su mejora paisajística','<p>JC: 25-04-2018: Subvenci&oacute;n muy interesante para complementar los trabajos que se est&aacute;n realizando en sacos. Muy en la l&iacute;nea que ya estamos realizando all&iacute;. Super.</p>\r\n<p>b) Tratamientos selv&iacute;colas de la vigorizaci&oacute;n del arbolado y mejora paisaj&iacute;stica:<br />Para zonas con una densidad de arbolado excesiva, q ue provoca una gran debilidad, estancamiento en el crecimiento, vulnerabilidad fre nte a plagas y peligro de incendios. Para ello se favorecer&aacute;n mediante claras a los mejores &aacute;rboles que pasar&iacute;an a ser dominantes, capaces de crecer ya sin peligro de estancamiento y con ello hacer crecer el monte, poner en valor su paisaje y reducir el riesgo de incendios.&nbsp;</p>\r\n<p>d) Repoblaciones forestales en terrenos de inter&eacute;s paisaj&iacute;stico, con un dise&ntilde;o del paisaje vegetal adaptado al medio. Tambi&eacute;n repoblaciones diversificadoras de monte arbolado, potenciado especies de inter&eacute;s donde sean escasas.</p>\r\n<p>e) Mejoras para la fauna dentro del monte: recuperaci&oacute;n de bancales agr&iacute;colas abandonados, destin&aacute;ndolos para siembras para la fauna, que al mismo tiempo actuar&iacute;an como fajas cortafuegos; recuperaci&oacute;n de antiguas fuentes y manantiales, o creaci&oacute;n de peque&ntilde;as charcas de llenado por escorrent&iacute;a; instalaci&oacute;n de nidales para peque&ntilde;as aves insect&iacute;voras, majanos para conejos o must&eacute;lidos, cajas refugio para murci&eacute;lagos, creaci&oacute;n de peque&ntilde;as charcas de llenado por escorrent&iacute;a y m&iacute;nimo mantenimiento, mantenimiento en pie de &aacute;rboles con huecos y agujeros de inter&eacute;s<br />para la nidificaci&oacute;n; mantenimiento de &aacute;rboles maduros muertos tumbados en el suelo, por la gran cantidad de insectos y larvas que es capaz de generar, adem&aacute;s de refugio en sus huecos; etc.</p>','https://drive.google.com/open?id=1-JG8x2wuc3X0nlS1aVsfYf0GEXizLveb','3/2018 EXP. 29',8,4,NULL,5,NULL),(97,'2018-04-26','2018-05-15','2018-04-26 06:07:38','2018-04-26 06:07:38','7OZQl9','Solicitud de ayudas a las entidades locales y entidades sin ánimo de lucro de la Comunitat Valenciana que promocionen la integración de los colectivos de la diversidad a través de la actividad física y el deporte.','http://www.gva.es/es/inicio/procedimientos?id_proc=18630','','','GV','10.000','El objeto de las ayudas es la concesión de las subvenciones destinadas a entidades locales y entidades sin ánimo de lucro para actuaciones y proyectos que promocionen la integración de los colectivos de la diversidad a través de la actividad física y el deporte que se realicen del 1 de enero al 30 octubre de 2018, excluyendo la participación en competiciones oficiales.\r\n\r\nNo se encuadrarán en estas subvenciones aquellos proyectos que vayan dirigidos a la población en general o a un segmento por edad y únicamente engloben una participación abierta a personas de colectivos de la diversidad.','<p>JC: 25-04-2018: en principio creo que no proceder&aacute;. He creado el usuario @Angel para gestionar este tipo de cosas con Familias Alternativas, pero bueno, no s&eacute; que pasa que no aparece en el listado de usuarios. Lo vamos mirando pero creo que no hay mucho donde rascar aqu&iacute;.&nbsp;</p>','','-',NULL,4,13,5,NULL),(98,'2018-04-26','2018-05-18','2018-04-26 06:21:11','2018-04-26 06:21:11','m4q3Gh','Solicitud de subvenciones destinadas a financiar la reforma y modernización de instalaciones y equipamiento de espacios escénicos existentes en 2018','http://www.gva.es/es/inicio/procedimientos?id_proc=19122','','','GV','< 70.000','Las subvenciones que se convoca tienen como finalidad financiar inversiones que tengan por objeto la ejecución de obras de reforma y modernización de instalaciones y equipamiento de salas o espacios escénicos existentes, que se ejecuten íntegramente en 2018.\r\nEl objeto de la inversión podrá comprender la ejecución de cualquier clase de obra de rehabilitación o mejora del espacio escénico, incluso su ampliación mediante la habilitación de espacios anexos al mismo. También pueden incluirse actuaciones referidas a las instalaciones escénicas y al equipamiento de la sala en un sentido amplio.','<p>JC: 25-04-2018: Podr&iacute;amos aprovechar el proyecto del escenario que hicimos para diputaci&oacute;n.</p>','','-',NULL,4,13,5,NULL),(99,'2018-04-26','2018-05-26','2018-04-26 06:26:37','2018-04-26 06:26:37','d6rmtj','Subvenciones a organizaciones no gubernamentales para el desarrollo (ONGD), para la financiación de proyectos de cooperación internacional para el desarrollo a ejecutar en países y poblaciones estructuralmente empobrecidos.','http://www.gva.es/es/inicio/procedimientos?id_proc=16844','','','GV','400.000','Convocar las subvenciones, en régimen de concurrencia competitiva, para la financiación de gastos corrientes y de inversión de proyectos de cooperación internacional para el desarrollo a ejecutar en países y poblaciones estructuralmente empobrecidos, destinadas a Organizaciones No Gubernamentales para el Desarrollo (en adelante ONGD).','','','-',NULL,4,4,5,NULL),(100,'2018-04-26','2018-05-18','2018-04-26 06:30:55','2018-04-26 06:34:58','kxEITt','Subvenciones para actuaciones de conservación y protección de los bienes inmuebles del Patrimonio Cultural de la Comunitat Valenciana','http://www.gva.es/es/inicio/procedimientos?id_proc=16662','','','GV','40.000 90%','El objeto de estas subvenciones es cofinanciar las actuaciones que se vayan a realizar sobre bienes de naturaleza inmueble: arqueológico, arquitectónico, etnológico y paleontológico, del patrimonio Cultural de la Comunidad Valenciana considerados Bienes de Interés Cultural o de Relevancia Local, y cuyos trabajos sean destinados a su protección, conservación y o recuperación dentro del marco de las atribuciones que corresponde ejercer a la Conselleria competente en materia de cultura.','<p>JC: 26-04-2018: Para alguna de las fuentes, est&aacute; claro. Como ibamos detr&aacute;s del <strong>Pou de Ses Peres</strong>, bien podr&iacute;a ir para ella.</p>','','-',NULL,4,13,5,NULL);
